INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1043565691, 16, 'Hertz Corporation Bond Certificate 1970''s', 24.95, 24.95, null, 0, 'Bob.com, Virginia', 39.080229, -77.87192, 'USA', '2001-12-04 04:02:04', '2001-12-14 04:02:04', 'Scripophily Makes a Great Gift for Everyone Our Stocks are worth the paper they''re printed on (sm) Our Company is a TRUSTED Buyer and Seller of Old Stock Certificates. Check out our About Me Page , where you can find out about us and read the recent articles about our company in Time Magazine, The Wall Street Journal, The Globe and Mail, Washington Post and our appearence on CNN. Beautifully engraved certificate from the Hertz Corporation issued in 1976-1977. This historic document was printed by the Security-Columbian Banknote Company and has an ornate border around it with a vignette of an allegorical man and woman sitting beside the company''s logo. This item has the printed signatures of the company_s chairman (Robert L. Stone) and vice-president,finance and assistant secretary. This bond is over 34 years old. Hertz, the world''s leading vehicle renting organization, is represented in over 140 countries, operating a fleet of 525,000 vehicles from approximately 6,500 locations. The pioneer of auto renting was Walter L. Jacobs who in September of 1918, at the age of 22, opened a car-rental operation in Chicago. Starting with a dozen Model T Fords, which he repaired and repainted himself, Jacobs expanded his operation to the point where, within five years, the business generated annual revenues of about $1 million. In 1923, Jacobs sold his car-rental concern to John Hertz, President of Yellow Cab and Yellow Truck and Coach Manufacturing Company. Jacobs continued as Hertz'' top operating and administrative executive. This rental business, called Hertz Drive-Ur-Self System, was acquired in 1926 by General Motors Corporation when it bought Yellow Truck from John Hertz. The Hertz Corporation In 1953, the Hertz properties were bought from GMC by the Omnibus Corporation, which divested itself of its bus interest and concentrated solely on car and truck renting and leasing. A year later, a new name was taken -- The Hertz Corporation -- and it was listed for the first time on the New York Stock Exchange. Jacobs became Hertz'' first President and served in that post until his retirement in 1960. He died in 1985 at the age of 88. In 1954, the new corporation bought Metropolitan Distributors, a pioneer in New York truck leasing dating back to World War I and the largest concern of its kind in any one city. In the process, the head of Metropolitan, Leon C. Greenbaum, became Vice Chairman of the Hertz Board of Directors; he later became Chairman, and in 1960, Chief Executive Officer. In 1967, The Hertz Corporation became a wholly owned subsidiary of RCA Corporation and operated as a separate entity, with its own management and Board of Directors. In 1985, Hertz joined UAL, Inc. On December 30, 1987, Hertz was sold to Park Ridge Corporation, a company formed by Ford Motor Company and Hertz management, for the purpose of purchasing Hertz. In 1988, Volvo North America Corporation joined Ford and Hertz management as an investor in Park Ridge Corporation. In 1993, Park Ridge Corporation was merged into The Hertz Corporation. In 1994, Ford purchased the outstanding shares of Hertz and Hertz became an independent, wholly owned subsidiary of The Ford Motor Company. On April 25, 1997, Hertz became a publicly traded company, listed on the New York Stock Exchange, under the symbol "HRZ." Hertz Today Hertz is headquartered in Park Ridge, New Jersey. Its current headquarters location opened in 1988. Prior to that the corporation was based in New York and, before that, Chicago. Oklahoma City, Oklahoma, is the site of Hertz'' Worldwide Reservations Center and Data Center, established in 1970, and its Financial Center, established in 1994. Car rentals, the largest and best known of Hertz'' activities, are conducted from more than 1,600 domestic, corporate and licensee locations, and approximately 4,500 corporate and licensee locations outside the United States. Hertz offers a wide variety of current-model cars on a short-term rental basis -- daily, weekly or monthly -- at airports, in downtown and suburban business centers, and in residential areas and resort locales. Today, Hertz'' Worldwide Reservations System handles approximately 40 million phone calls and delivers in total approximately 30 million reservations annually This Authentic certificate looks great framed and is much nicer in person than the scan indicates. For further information about our auction item for sale, please click here or feel free to call our toll free number at 1-888-STOCKS6 or Direct at 703-787-3552. We sometimes use an image of the same type of certificate that is for sale. The certificate for sale will be the same in all material respects i.e. type, era, vignette, logo, etc. Don''t stay awake suffering from Internet Auction ANGST , check out our Scripophily Auction Guarantee. We offer a 7 day no hassle satisfaction guarantee return policy in the event you are dissatisfied for any reason and a lifetime return policy if you find the item not to be authentic. To the best of our knowledge, everything we sell is 100% authentic and we do not sell reproductions of stock and bond certificates. There are not many companies who offer this type of guarantee in an auction. Our company has over 2,800 positive feedback comments on EBAY and we strive for 100% customer satisfaction. This will make a nice addition to your collection or a terrific historical gift for someone special. A $3.95 Priority Mail shipping charge(our cost in heavy cardboard envelope) to be paid by buyer for shipping within the United States. We will also ship anywhere in the world using Priority Mail and you will be charged our cost. If you buy other items from our auctions or web site, you only pay postage once if we mail everything together. We accept Visa, Mastercard, American Express, Paypal and Billpoint, checks and money orders. Please note that as with all of our certificates, we are not selling ownership interests or transferring any rights in the company, but we are selling an authentic stock certificate as a collectible. Our Company is a leader on the internet in buying, selling and researching collectible stock and bond certificates. We have been in business selling certificates for over 11 years. We are also members of The American Institute of Certified Public Accountants, Washington Historical Autograph and Certificate Organization, Old Stock Exchange, EBAY Power Seller Program, Universal Autographs Collectors Club, and The International Bond and Share Society. Our Company is a name you can Trust. Contact auctions@Scripophily.com with Questions View some of our feedback on Ebay CLICK HERE! View our other auctions currently on Ebay CLICK HERE!');
