INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1043817906, 33, 'NEVADA ghost town bottle digging book, 1961', 6, 6, null, 1, 'Iowa', 41.363615, -93.41494, 'USA', '2001-12-04 16:56:27', '2001-12-14 16:56:27', 'GREAT BOOK from the early heyday of bottle digging. This 55 page book by Adele Reed describes visits to 12 Nevada ghost towns and 4 California ghost towns, a description of what remained of the town and the bottles they dug in each town. It is autographed by the author. The Nevada towns included Goldfield, Virginia city, Sutro, Aurora, Belleville, Teel''s Marsh, Candelaria, Belmont, Manhattan, Eureka, Austin,& Tonopah and the California towns included Mammoth City, Big Pine, Blind Springs Hill, & Bodie. There are drawings of the bottles they found at each site and a drawing of one of the remaining buildings. It is a truely interesting book with a little history thrown in. The book is 8 1/2" by 11" and while used the only damage is some water spots, wear and dirt on the cover. Buyer pays $1.50 shipping and checks require 10 days to clear.');
