t hosiery or any of our items. You can pay for this auction with: Money Order, Personal Check (will send you the item when it clears), With Your Visa Or MasterCard in the U.S. You Can Use PayPal. PayPal is now available around the world. Click on the PayPal logo below or visit them at: http://www.paypal.com, or, If You''re An International Bidder, You Can Use Bid Pay To Send A Western Union Money Order In U.S. DOLLARS! They are at http://www.bidpay.com And now a quick word about our rules of the road. Please Take 2 Minutes To Read This And Avoid Delays Or Misunderstandings: 1.) Please Pay For Your Item Within 5 Days. If You''re Having An Emergency Or A Problem, Let Us Know, We''ll Work With You. Items not paid for in the specified time may be withheld from the non-paying bidder and may relisted. 2.) Non-paying Bidders Will Receive A Non-Paying Bidders Notice To eBay And Face Negative Feedback, And Ultimately Termination Of Their eBay Account If They Make A Habit Of Not Paying For Auctions. 3.) All Sales Final Unless Otherwise Marked So Please Ask Any Questions Before You Bid. 4.) If You Win More Than One Item Within 24 Hours, Please Be Sure To Let Us Know, So You Can Enjoy Combined Shipping And Save Money 5.) Please Include A Copy Of The Notification Letter With Your Payment For Fastest Service, Whether You Pay By PayPal Or Snail Mail. If You Don''t Please Be Sure To Include The eBay Auction Number For Each Item, As Well As A Small Description Of Your Item(s) For The Fastest Service! 6.) Unlike A Majority Of Dealers On eBay We Leave You Feedback A.S.A.P. After Receiving Your Payment. We Would Appreciate Positive Feedback From You If You''re Happy With Your Item When You Receive It. 7.) All Money Order or Check Payments MUST be drawn on a U.S. Bank, in U.S. Dollars. For example: A Money Order From The Royal Canadian Bank in U.S. Dollars is NOT accepted, not because we don''t like Canadians, but because our bank imposes a hefty fee for such money orders. Canadian and European customers are encouraged to use PayPal or Bid Pay for payments. 8.) If you pay with PayPal and you have won multiple items, PLEASE make only 1 PayPal Payment and include all the auction numbers on the one payment. It simplifies it for you and for me. Also, PayPal charges a transaction fee for EACH payment made, in addition to their OTHER fees to the seller. We combine shipping to save you money - please combine multiple auction PayPal payments into ONE to help keep our costs low, so we can KEEP providing Lower Cost combined shipping.... A quick check of our feedback will show you that nearly every other buyer buys from us more than once!! Also, a larger percentage of our feedback centers on our FAST SHIPPING!!! Are you tired of paying for an item and waiting for 2 weeks? Not with Kathy''s Nostalgiabilia. We get your money on Monday, and your item goes out by Wednesday or sooner if possible!! Our shipping rates are still among the best on eBay, even with the recent rise in rates in the Post Office. For up to 4 pairs of stockings: In the U.S $2.50; Canada: $2.75; Europe: $3.75. If you win other than hosiery items, Please See Listing For Actual Shipping Rate, or buyer is responsible for reasonable shipping rate. Believe me, ours are among the best shipping rates on eBay!! Our feedback profile is proof we deliver, however, we are not responsible for loss of goods in the mail that are not insured. Insurance is extra and based on total. Insured items go out once a week: Monday. Non-insured items go out a.s.a.p. upon receipt of payment. Kathy''s Nostalgia Guarantees Every Item To Be As Described Or Your Money Back! Click here to view my other auctions. Arizona residents please add 7.25% sales tax. Thank you. Stay Brave, Stay Free. DO NOT Let The Forces Of Evil Conquer Your RIGHT To Live FREE! Created by eBay Seller''s Assistant Pro');
