INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1044808556, 201, '417785 Christmas Girl - Limited Edition! NR!', 9.99, 9.99, null, 1, 'Lakeland, FL', 28.042948, -81.9849, 'USA', '2001-12-06 15:24:56', '2001-12-16 15:24:56', '"May You Have An Old Fashioned Christmas" Porcelain Doll by Precious Moments. An adorable auburn haired wide eyed doll dressed in green and red Christmas plaid. She is wearing a green velvet hat and matching cape with red trim. Her hair is in a thick braid down the center of her back. She has a petticoat and pantaloons. Her head and hands are of porcelain bisque. The neck has the vessel mark. This doll was limited to production during 1991 and 1992 only. There will never be any more of this doll, so go for it! The original price for this doll was $150. It is in its original box and the certificate of authenticity is included. I have quite a Precious Moments Collection including dolls, plates, figurines, members newsletters, clocks and other miscellaneous items. I am downsizing to a smaller house in a few months and I need to sell a great many of my pieces. Since you are viewing a doll, I want to let you know I also have for sale the following dolls: 12475 - PD; 12483 - Trish; 12424 - Aaron; E-6214G - Debbie; 12432 - Bethany; 427527 - You Have Touched So Many Hearts; E-2851 - Kristy; E-2850 - Mother Sew Dear (mother with needlepoint in chair); 12491 - Angie the Nurse; 429589 - Pink Baby Doll on Pillow. I also have several soft Precious Moments Dolls made by Applause. For sale are Flippy, Peggy, Donny, Roly, Nancy, Jeannie and a few others. If you want to ask about a particular doll or piece, just email me and I will let you know what I have. This is a great time to stock up for Christmas gifts!! Thanks for looking! I prefer Ebay Online Payments and accept Billpoint, PayPal, money orders and checks. I expect payment within 10 days after the auction ends. Checks are held for 10 business days to clear. Returned checks have a $25 processing fee. Serious bidders only please. For those bidders who do not complete their transactions, I will be forced to leave negative feedback. Smoke free; pet free home. All items are measured and described correctly and not returnable. If you have any questions at all, please email me. I ship by USPS Priority Mail and insurance is optional. Happy Bidding! Free Honesty Counters powered by Andale! Payment Details U.S. Shipping and Handling $10.00 Shipping Insurance per item (required) $2.00 Sales Tax (none) _ Learn more about checkout Payment Instructions No returns. Insurance required on this item.');
