ates are easily twice to three times the weight of a typical Bradford Exchange plate so shipping 1 plate is $6.45; 2 plates are $8.35 and 3 plates are $10.00. I try to give an accurate description of the condition so you know what you are purchasing. Please feel free to E-mail me prior to bidding if you have any questions. Will do my best to get the plates out as fast as possible, but shipping during the holidays can be slow. Thank you for looking. PLEASE SEE MY OTHER PLATES LISTED ABOVE NEXT TO Bigdawg85.');
