(PayPal and Billpoint can accept your credit cards and Personal Checks, just click on the logo below for more information). If your are the high bidder on more than one of my auctions you can save on shipping costs. TERMS: Upon receipt of your payment shipment will be sent the following day. Payment must be received within 10 days of auctions'' end or item will be relisted. Please email me with any questions and THANK YOU FOR LOOKING!!');
