INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045023664, 342, 'Stone Print Play Billboard - Robinson Crusoe', 179, 179, null, 0, 'Pecatonica, IL', 42.307665, -89.34453, 'USA', '2001-12-06 20:04:11', '2001-12-13 20:04:11', 'Early 1900''s Stone Print Theatrical Troupe Play Billboard Poster This Theatrical Poster Billboard is Stone Print Paper. It is 7 foot, 6 inches tall and 41 inches wide. Stone Print, Two Piece, Unused. Extraordinary Graphics! Close up of a small section This exceptional Robinson Crusoe poster was taken around by a "Front" man in advance of a traveling troop of actors who would go from town to town performing theatrical plays around the turn of the century. The Front man would write in with a crayon, or print on with a block printer, the time, place, and price details in the empty box at the top, then paste these to a wall or other appropriate place. Sometimes they went into frames in front of the Opera Houses or theaters that they were performing in. Predecessor to the movie poster! Phenomenal detail and coloring! Vivid colors, no fading! This has been rolled up in an old closet for over 80 years. The billboard poster is thick paper (not cardboard). It was rolled out on a sheet of wood and covered with transparent Storm Door window film. The reflection in the photos is from the transparent Storm Window Film that is stretched over the billboard. Click Here For Larger Photo We would send it rolled up in a tube. Would look sharp framed or wallpaper pasted to a wall. That is a 3 foot yardstick on the right side of photo. This is in Perfect Condition . Being sold to the highest bidder with no reserve. It''s heavy, Buyer pays $3.95 actual Priority Mailing costs. Illinois residents pay 6.25% sales tax. We''re happy to combine shipments where practical to save you $$$. We accept personal checks or money orders, etc. We do not subscribe to electronic payment systems. To see our list of Unique and Unusual Items on Ebay, Click Here, Then Bookmark it! Check us occasionally. We list neat stuff like this all the time! Click here to E-Mail us Direct! No packing or handling fees, Always reasonable starting bids and NEVER A RESERVE!!! Have It By Christmas We perform one day turn-around at our end with money orders. Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
