INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045080937, 375, '"ONE TEAR AT A TIME" Video - Brand New!!', 24.95, 24.95, null, 0, 'NJ', 40.879049, -74.29378, 'USA', '2001-12-06 22:41:08', '2001-12-16 22:41:08', '"ONE TEAR AT A TIME" TORN AND RESTORED CARD VIDEO! BRAND NEW! "One Tear At A Time" the ultimate torn and restored card by J.C. Wagner is a KILLER!!! Developed by the man who has had more influence than almost anyone else in magic on the Torn and Restored Card theme, J. C. Wagner, this is a practical and magical rendition of a classic card routine. Both the effect and the method are simple and direct! A card is selected and SIGNED along one edge. The card is then creased and torn into four VERY distinct pieces. Two of the pieces are put aside and the two remaining are visually and magically restored into one piece!! One of the remaining two pieces in now VISUALLY restored to the first two. The restorations are clean and beautiful to watch. With the last piece you get to see a J.C. presentation "Master Stroke" and why his creations are always tuned to the audience!! The last piece is placed with the first three and then handed to the spectator. The spectator holds the pieces for a moment and then opens the pieces to find a TOTALLY RESTORED SIGNED CARD !! Please add $4.95 s/h. "ABSOLUTELY BEAUTIFUL TO WATCH" Money Order or Cashiers Check ships your item within 24 hours. Personal Check accepted but will delay shipping of your item. Payment must be received within 10 days of the end of the auction. Shipping & Handling to be paid by winning bidder, insurance extra. Please see description. Please CLICK HERE to look at my other auctions. Thank You and Good Luck! See the other items in our Auctiva Showcase My Service Box Credit Cards : Money Orders : Web Payments : Bidder Tools : Shipping : By Auctiva This listing generated by Auctiva Poster Download it for free!');
