INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045246222, 480, 'PAAP - "I Promise You An Ocean..." MIB NR!', 17.99, 17.99, null, 0, 'ParkForest, IL.', 38.588301, -88.03692, 'USA', '2001-12-07 13:08:44', '2001-12-14 13:08:44', 'You are bidding on an adorable figurine from Kim Anderson''s Pretty As A Picture Collection by Enesco. This is lovely figurine of a girl smelling a rose at the beach is titled "I Promise You an Ocean Filled with Dreams". It measures approx. 4" inches and is item #630101-copyright 1999. Enesco announced the retirement of this figurine on June 11th of 2001, so get her while you can! It is in mint condition (no chips, cracks, or nicks) in the box with all the papers and has been removed for the photo only and never displayed. This retired piece will make a wonderful addition to any collection! If you have any questions please send me an email and be sure to bookmark/view my other auctions as I will be listing many pieces from this line (PAAP) and other figurines, dolls, doll accessories, teddybears, toys, and many other collectibles daily. Buyer pays actual S&H and I will combine multiple items to save on shipping. I accept paypal, billpoint, and money orders which must be received within 10 days of auction closing. Thanks for viewing and good luck!');
