INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045258842, 484, 'Bone china little girl with kittens in barrel', 9.99, 9.99, 13.63, 0, 'dayton ohio home of hangar 13', 35.495894, -85.01032, 'USA', '2001-12-07 13:38:20', '2001-12-17 13:38:20', 'Here is a cute whymsical little girl with kitten in a wheel barrow. Maybe she just found them in the barn? She stands about 3.5 inches tall. There is no tag on her but on the bottom of her base there is the marking of crossed sables and a wreath or a ring in the center of the two blades and the number of 1402 which leads me to believe that is may be from Enesco or Napco? The remains of a tag can be seen. If you know the tradmarks then you will be able to figure this one out. No breakage or crazing. she is in a matt finish. DO NOT USE CHECKOUT... We Do Not accept Checkout transactions. we Do Not accept eBay/Billpoint payments of any kind. We DO accept PayPal, Money Orders, cashier checks, Bidpay payments. WE will send winning bidder an email at auction''s end with shipping/ins. fees...please reply directly to us. Please read auction for all details. We do not use checkout feature and will email you ourselves. return request will only be considered within 2 days from receipt and must be received by us in email. Shipping must be postmarked within 4 days after we have accepted the request. Return only upon item not being as described or damaged in transit. We insure all items through shipper so paperwork must be completed with help of buyer before refund for damage. Please contact us first. Please read all stipulations below, if you cannot honor or abide by them, do not waste our time or yours. We do not enjoy giving negatives or receiving threatening mail about an impending negative or non paying bidder process, but to be fair we have guidelines that we follow and make perfectly clear in our auctions. I really regret having to implement these stipulations in our auctions, but irresponsible bidders and timewasters have made it necessary. Those buyers who do not seem to understand that we do not take checks also have made this necessary. For those of you who are responsible bidders, who read the entire auction before they bid, please know that this is not aimed at you and that we welcome you and your purchase. I have met a lot of really nice courteous bidders and sellers here and hope to keep meeting you all in the future. For you repeat buyers, thank you for your trust in me and I really do value your business. 1. we use a set shipping and insurance fee . This fee will take in oversize boxes if this pertains to the auction, and delivery confirmation and insurance on all items. It does also include a handling fee in the amount which will take care of our expenses in getting the item to you safe and sound, extra insurance and sales tax. We try very hard to be as close to the shipping and insurance as we can,but still allow extra for the above. Shipping will be on the Saturday after payment is recieved. Shipping will be by Priority mail insurance , delivery confirmation and handling fee will mean a total shipping price of 6.50 for this item. non US bidders will need to pay more. Please contact us to make sure that we mail to your country before you bid and to check out the shipping and insurance costs. There are some countries that do not allow insurance and therefore we are not able to send to this country. 2. . I do reserve the right to not accept bids from those with negative feed-back ; history of non payment; late payments; lack of communications or unreasonable demands or retractions. If you snipe at the last minute, we will hold to these same standards and may not honor your bid for the same reasons. All bidders are held to the same standards to be fair. Regardless of feedback or buyer/seller status. 3. Payment is fine money order or cashier check. We are no longer taking checks. If you send a check, it will NOT be considered payment and will either be destroyed or returned with your merchandise upon proper payment. We also take paypal payments from verified accounts which unfortunately does not include other countries at present. You would send to momahedger@aol.com. 4. We do participate in the NPB process. 5. I leave feedback when I know that the buyer has recieved their item. I do not need for the buyer to leave it first, but I do need to know that the item has arrived. I rate my buyers on their payment, on their communication with us during and after the auction and their reading and following our guidelines in the auction. Many sellers do it different. As soon as I know that the item has arrived I will go and leave feedback . Ruby Lane Antiques & Collectibles');
