INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045275048, 497, 'UNEXPECTED #133,1972,cgc,9.0,owtwp', 18.5, 1, null, 3, 'SI, NY', 43.11595, -73.31852, 'USA', '2001-12-07 14:25:06', '2001-12-14 14:25:06', 'UNEXPECTED #133,1972,cgc,9.0,owtwp p align="center" UNEXPECTED #133,cgc,9.0,owtwp I WILL BE AWAY FROM DEC. 22ND TO THE 31ST, SO ANY PAYMENTS RECEIVED AFTER THE 20TH WILL SHIP ON JAN 2ND. MY WEB ADDRESS IS: CLASSICCOMICINVESTMENTS.COM PHONE(347)-672-3878FLASH #12 Please read this in full. MY NAME IS JOSEPH SERPICO. I belive the books and the free market speak for themselves (IN MOST CASES), so why thrust a imaginary support level on the auction? The cgc census report is now avalable on their web site, cgccomics.com (as of 7-12-01). I strongly encourage all serious bidders to visit this site, especially when bidding on more expensive or scarce books. Many of the books I offer up on ebay and on my website are of the highest slabbed grades at present, or in a good number of times-the ONLY book of it''s kind to have been graded. This information is powerful when buying, selling or bidding. I am a CGC Charter member, and AACC member. My grading is guaranteed,-refering to unslabbed books, naturally- I have been a collector and seller/dealer for over 35 years. Many references available, if you need them. If not satisfied I will return a full refund for the books, as long as they are returned in original condition. All items packed securely. Shipping is $6 in the Cont.USA. Insurance is extra-$2 and up-(for merchadise $100 or more) depending on price of book, and I will not be responsible for uninsured books(anything over $100). I usually ship ONCE a week depending on volume, (sometimes more), using either USPS-priority mail, OR Fed Ex ground, either takes 2-4 days. All CGC books are non returnable, I will warrenty against any cracks in the slab, though. Most (USPS) books sent by certified. Overseas postage is at LEAST $15 per package, so please keep this in mind if you are bidding from overseas, or just please refrain from bidding. Also, most bidders are honorable, but do not bid if you are unsure that you can make payment and agree to terms. For USA orders, you may combine up to 5 CGC books and up to 12 non CGC books per order. Thanks for looking, have fun, and please visit my web site and other auctions. MY PHONE NUBER IS 347-672-3878, MY WEB SITE ADDRESS IS- CLASSICCOMICINVESTMENTS.COM Payment Options: I accept the following forms of payment: PayPal, Visa/Master Card, American Express, Money Order, Personal Check. Low cost image hosting and full service auction management solutions: AuctionWatch');
