ithin one day of receipt. We like to be in contact from beginning to end of each transaction. California residents must include 8% sales tax. When questioning shipping costs, please include city and zip code. We ship only UPS within the continental U.S. and to Canada. USPS to Alaska and Hawaii. Everything is VERY well packaged and insured. Thanks! Come visit our other auctions! New treasures every week! RETURN POLICY: Anything you receive you don''t like for any reason may be returned. Never a problem! Our customers happiness and satisfaction is our number one concern. Visit DIAMOND323 UPSCALE HOME DECOR today! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Thank you! eBay checkout information does not offer options I need to instruct you, so please write me at Diamond323@aol.com, or I will write you. If you are in CA, we must charge 8% sales tax. We ship UPS with automatic insurance. Upon receiving your name and address, we will email you personally with friendly instructions on how to proceed. Thank you again!');
