INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045363331, 605, 'Homco Circle of Friends FigurineTaste And See', 4.25, 1, null, 2, 'Cambridge, Minnesota', 45.566735, -93.24381, 'USA', '2001-12-07 17:45:44', '2001-12-14 17:45:44', 'Homco Circle of Friends Figurine - Taste And See - from Home Interiors. No cracks or chips. PLEASE READ ALL TERMS! The Buyer pays a fixed $5 shipping and handling charge. Insurance is extra. I do not ship outside of the continental United States unless special arrangments can be agreed upon prior to the end of the auction. Contact must be made within 3 days after close of auction. Payment must be made within 10 days of close of auction. I accept personal checks, cashier checks or money orders(If you pay with a personal check the item will not be shipped until check clears). I only accept Paypal if the buyer agrees to pay an additional 3% on the total due (this covers the charge that paypal charges me for my premier account). If you do not wish to pay the additonal 3%, then you must pay by another method! SERIOUS BIDDERS ONLY, PLEASE! GOOD LUCK BIDDING! Payment Details U.S. Shipping and Handling $5.00 Shipping Insurance per item - Sales Tax (none) _ Learn more about checkout Payment Instructions PayPal payments can be sent to shortcakequeen@hotmail.com Please include your shipping address with payment.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045365342, 608, 'Dark Green!! Atlas Strong Shoulder Mason', 9.99, 9.99, null, 1, 'East Texas', 33.00542, -96.89773, 'USA', '2001-12-07 17:50:01', '2001-12-14 17:50:01', 'Tired of buying jars on eBay with fog, haze or stain? I sure am. We sell no jars with stain of any kind. We charge actual postage fees, so if we over charge you, even 10 cents, you''ll receive a check from us for the 10 cents without you even asking. Here we have a gorgeous dark green quart Atlas Strong Shoulder Mason, sporting a good Atlas zinc lid. It''s crystal clean with what I would call no damage. It does have a couple of micro nicks on edge of rim from use. Super nice jar in an unusual super nice color. Do yourself a favor and click here to view our other auctions. We have 60 jar auctions we are listing this weekend. SAVE MONEY, COMBINE SHIPPING. Buyer pays ACTUAL shipping charges (there is never a charge for package material or a handling fee), insurance is optional. We package all merchandise very carefully, therefore we will not be responsible for lost or damaged merchandise if not insured. ***WE DO SHIP INTERNATIONALLY!*** Shipping charges internationally will be determined after the sale. International sales must be pay by US funds. E-mail any questions!!!! We accept money orders, cashiers checks and personal checks. Purchases made with a personal check may be held 10 days for check to clear. Payment should be received within 10 business days from end of auction (unless prior arrangements are made), otherwise we may consider sale void. GOOD LUCK, GOOD BIDDING, AND HAPPY HOLIDAYS!!!');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045365533, 610, 'Precious Moments 1993 BUNDLES OF JOY', 24.99, 24.99, null, 0, 'Clarksburg, WV', 39.285204, -80.385344, 'USA', '2001-12-07 17:49:51', '2001-12-14 17:49:51', 'Bundles of Joy _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ This Precious Moments, Bundles of Joy (E2374) will come to you in excellent condition (never displayed) with paperwork. The production mark is the butterfly. It was first issued in 1982 and was retired in 1993. The retail price of this piece was $45.00 and the 2001 Collector''s Value Guide has this piece currently valued at $81. This would be a great addition to any collection, or make a wonderful gift. NO RESERVE! Happy bidding and best of luck! Payment must be received within 10 days of the end of the auction. PayPal, Billpoint, Money Orders/Cashier''s Checks and Personal Checks are acceptable methods of payments for residents of the U.S. However, if paying by a Personal Check the item(s) will be held for 10 days after receiving payment to give the check time to clear. International payments can be made by PayPal or an International Money Order. Shipping & Handling of $4.50 is to be paid by winning bidder for U.S. residents. Insurance is an additional $1.10 for up to $50 and $2.00 for $50-$100. International shipping will be determined at the end of the auction. West Virginia Residents add an additional 6% sales tax. Thanks for looking at my auction, and please look at my other items for sale! Multiple wins shipping to the same address can be combined to save on shipping costs. View and search all the items in my picture gallery Auctiva PowerTools . Create, Schedule, Manage your auctions Free Trial!');
