INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045388760, 623, 'Precious Moments Star Morning Enesco Box Mint', 8.5, 1, null, 4, 'Mesa, Arizona', 33.276539, -112.18717, 'USA', '2001-12-07 18:29:19', '2001-12-14 18:29:19', 'Precious Moments Bisque Figure, He Is The Star Of The Morning. A figurine of an angel child decorating the manger with sleeping Baby Jesus inside, a box of ornaments sitting on a cloud, a patch on the angel_s gown. This figure is signed, Sam B. and marked on the bottom, Precious Moments collection, He is the Star of the Morning. Copyright 1989 Samuel J. Butcher. All rights reserved worldwide. Licensee Enesco Corporation 522252. This is in perfect, undamaged MINT condition. Figure comes original styrofoam packed in the original box, which is in excellent condition. Also comes with the original card and an insert to join the collectors club. Precious Moments Last Forever. Since 1979, these teardrop eyed children, messengers of love, caring and sharing have reached out and touched the lives of millions of people with their poignant expressions and inspirational messages. In happy times or sad, holidays and everyday, a Precious Moments gift is a lasting reminder that will grow dearer with the memory. A great Christmas present. If you pay promptly, Post Office should be able to deliver this in time for Christmas. A Continental USA buyer will pay $5.00 priority shipping, insurance extra. International buyers pay actual shipping and are welcome to bid. Please pay within 10 days. Checks are welcome but will delay shipping by 7 to 10 days for time to clear your account. Please feel free to ask any questions.');
