INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045394164, 630, 'Gold Key: Bonanza 31', 5.5, 1, null, 4, 'Montreal', null, null, 'Canada', '2001-12-07 18:35:40', '2001-12-14 18:35:40', 'FN nice copy For larger scan than below, email: thinkbach@globetrotter.net Payment is by personal check or money order. You can also pay using credit cards with BillPoint or PayPal. Rates for surface shipping in the US or Canada are as follows: 1 comic.......$2.25 2 comics......$2.50 3 comics......$3.25 4-9 comics....$4.50 10-15 comics..$6.50 16-35 comics..$7.50 Larger........$9.50 up to $15 per large package For International orders please email for exact rates. Above rates apply to regular sized comics, Prestige format issues count for 3 regular comics. Multiple auctions may be combined. The good news is that shipping from Canada to the USA works great, but it is a tad slower than from within the US. Hopefully service and price can make up for the lag. You be the judge :) All purchases guaranteed, and check my feedback for comments on grading. My kids and I thank everyone who has ever bought from me, and remember that if you are not satisified with your purchase I do always want to make it right in whatever way that satisfies. Please feel free to access my eBay info if email is for some reason not getting through. Always auctioning comics. Hundreds of Dells, DC & Marvel Silver Age to come. Superheroes, Westerns, War, TV/Movie, plus tons of modern material. This is an ongoing thing until I can write all day for a living, so please cut and paste the following line into your browser, then bookmark it: http://cgi6.ebay.com/aw-cgi/eBayISAPI.dll?MfcISAPICommand=ViewListedItems&userid=thinkbach&include=0&since=-1&sort=2&rows=50 And Now A Word From Our Sponsor - Are so-called "snipers" beating you to the win? Are the other bidders waiting until the last second to walk away with the prize you would have have paid more for? Hey, if you think you''ll miss the end of an auction, consider bidding the max above the current raise that you would be willing to go. Best of luck! and thanks for your bids :)');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045399008, 635, 'Maud Earl''s Beagle Print', 9.99, 9.99, 35.96, 0, 'Center Valley, PA', 40.540398, -75.41501, 'USA', '2001-12-07 18:42:48', '2001-12-14 18:42:48', 'Beagle Print by Maud Earl original was done early 20th Century in England. An 11" x 8" print on heavy weight coated offset paper. A lovely canine print for framing. Prints may also be provided in different sizes and on canvas suitable for framing or brush stroke addition. These are fine art print reproductions from the original works of Maud Earl a very well known Dog Portriature Artist of the late 19th and early 20th Century. For more information on Maud Earl''s Dog Portraits open the link below: Maud Earl''s Dog Portraits These print reproductions capture the essence of the dog breeds and will enhance the home decore of the dog lover. Buyer pays for shipping via USPS or UPS for single print purchase order. Please email any questions PRIOR to bidding. Buyer pays $4.00 S/H for USPS priority shipping. Additional prints purchased from other eBay auctions or from the website ordered separately and shipped in same container travel for the single shipping fee Money order or credit card ships same or next day, except when brush stroke detailing added which requires extra drying time. Payment must be made within 10 days of sale. We accept VISA/MasterCard, money orders, cash, and personal checks (please allow extra time for your check to clear before shipment). We do not accept Pay Pal. Thank you for your bids and if you win thank you in advance for honoring your bid and prompt payment. We post negative feedback if you do not honor your bids. Maud Earl''s Beagle Print Maud Earl''s Beagle Print, 11" x 8" Image Size on Heavy Weight Coated Offset. Please check our other auctions for other canvas and arches paper giclee reproductions. Brush stroke detailing can be added to the canvas reproductions. Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
