INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045471787, 710, 'DAVIS EMBOSSED OPEN PONTIL MEDICINE BOTTLE', 14.95, 14.95, null, 1, 'Newton, Mississippi-Looking for Santa', 32.317298, -89.14483, 'USA', '2001-12-07 20:43:51', '2001-12-17 20:43:51', 'Here is a classic open pontiled aqua medicine bottle. It is 5 1/8 inches tall and has 3 sunken panels. It is embossed: DAVIS arched in a recessed square on the front and VEGETABLE on left side and PAIN KILLER on the other side. Has a nice applied double collar and beveled edges. Similar to Greer''s but this size not listed. Digger Odell states in his book, Pontil Medicine Encyclopedia, that Perry Davis was a carpenter and discovered this formula and began selling this medicine in a basket-What a change in occupations. Digger does not list this size either. This medicine was also referred to in the classic novel of Tom Sawyer. The condition is good-it is dug with a nice haze. No chips, dings or cracks in the glass. The glass is crude and has wonderful whittle. The base is the real odd feature-has a horseshoe type key mold, an x on each side with a nice open pontil in the center. Would make a nice addition to any Early pre-civil war or Pontiled Medicine bottle collection. No reserve. Thank you for looking at this item and God Bless. Click on a picture to enlarge '') //-- '') //-- '') //-- Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Buyer to pay actual priority shipping with insurance extra if desired-recommended. Ship next mailing day on money orders.');
