ible for estimating your own cost to wherever you live in the world, above all, BID WITH CONFIDENCE. THANKS FOR YOUR INTEREST & TRUST! HAPPY BIDDING!! NEW NEVER USED. I DONT KNOW WHAT THESE ARE USED FOR , ONE IS FOR LIQUIDS, THE OTHER REMINDS ME OF A PARMESSAN CHESE SHAKER. $4.50 TO MAIL ALL OF THE USA. WOW!!!! NO RESERVE!!! LOW STARTING BID!! FREE $1.00 CASH OFF YOUR SHIPPING IF YOU PAY WITH MONEY ORDER,OR BIDPAY ONLY! (offer not good for personal checks,or paypal.not good for out of the country, good one time for combined auctions.) Buyer to pay all listed shipping/handling fees as listed in most all description sections of my auctions, that price IS NOT negotiable, but ,combine with other auctions for a much lower shipping rate, insurance if desired but,IM NOT RESPONSIBLE FOR UNINSURED ITEMS. Please allow time for personal check to clear (14 days) or send m.o. for quick shipping (3-7 business days). some items might take a little longer. I now accept pay pal,and bid pay, for credit card purchases. (also ship in 2-7 business days.) as some weeks i only mail 1-2 days a week. payment should reach me within 7 days, but PLEASE! dont mail payments expess,overnight,or priority mail, as long as you put it in the mail box within 1 week after the auction ended, thats fine,just dont waste your money. Please check out the other auctions we currently have running on eBay. GOD BLESS AMERICA! OUR PRAYERS TO ALL OUR FELLOW AMERICANS TOUCHED IN THIS TRAGEDY. UNITED WE STAND! Free counters provided by Honesty.com This listing created by eBay Seller''s Assistant Basic.');
