rst class, with a small fee for the bubble mailer. Books can be shipped by media mail, to save money. Heavy items can be shipped U.P.S. per request, other carriers as needed.............We request all auctions be paid within 10 days. We accept CASH, CHECK, MONEY ORDER OR PAY PAL..... Checks will be held 7 business days before your item is sent, cash or money order guarantees your item to be shipped the next day. Insurance is your option but if it breaks or is lost.... "it''s on you"..............Maine residents please add 5% sales tax or provide a resale #........If you have any comments or suggestions please feel free to email us at my2kradios@prexar.com. Thanks again for your interest in our auctions......................................................... .............................................................');
