rse, uninsured items that are damaged/lost during shipment or items that a buyer thought was something it wasn''t. Insurance is offered and recomended, even on books. If it is lost or damaged during shipping, I can not be held responsible. IF YOU DO NOT INTEND TO BUY, DON''T BID. NON PAYMENT WILL GET YOU A NON-PAYING BIDDER WARNING AND NEGATIVE FEEDBACK. Never a handling charge. Seller reserves the right to not sell to a user with excessive negative feedback. THIS IS A NO RESERVE AUCTION. PLEASE SUPPORT OUR NATION, GIVE TO THE AMERICAN RED CROSS. THANK YOU. PLEASE NOTE: FAILURE TO COMPLETE THE TRANSACTION WILL RESULT IN NEGATIVE FEEDBACK. PLEASE DO NOT BID IF YOU ARE NOT SERIOUS ABOUT PAYING. NO EXCUSES FOR NON PAYMENT ACCEPTED. IT IS YOUR RESPONSIBILITY TO GET PAYMENT TO US. Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
