f you would like it. If you do not choose to insure your package, I CANNOT be held responsible for items once they are shipped. Email confirmation MUST be received within 3 days of the close of this auction. Payment must be received within 10 days of the close of the auction or other arrangements made or non-paying bidder alert will be filed with eBay. Thank you for looking!! Please take a moment to view more of my auctions. Click here to view my other auction items. If you have any questions, please do not hesitate to email me. I will gladly supply information or more photos. Click here to send me an e-mail Click here to visit my website.');
