arked on the bottom: P.C.A., Made in W. Va. Also, both shakers read God''s Country, Potter County, PA on the front. This set is in excellent condition with no knicks, chips, cracks, or crazing. Each shaker has the original cork stopper. This item would make a great addition to any collection!! Also, would make a great gift!! Shipping and handling for this item will be $5.55(this amount includes insurance). I understand that, at this time I have little feedback under this user id, however I have a different user id that I have been listing under for some time. To view my feedbacks under that id look under Chrkee87. Please understand, the reason for the new id is due to several people asking me to list items for them. So, I decided to start a new site just for items that are not mine. However, keep in mind that I have all items I am listing in my possession and I will be doing all shipping of these items from my home. This will eliminate any communication problems between buyer and seller. As always, thanks for viewing my auctions. Pictures speak a thousand words, so please take a moment and look, you''ll be glad you did. Thanks for looking. We are open to questions via email. Please do so before you bid. We will do our best to answer your questions. DISCLAIMER Payment: Payment MUST be received within 7 days from the close of the auction. We reserve the right, to cancel bids, from buyers who have negative feedback for non-payment. After 7 days item will be relisted. All our items are sold AS IS and are represented to the best of our knowledge. Buyer pays all shipping charges. Shipping cost for all items will include insurance. We ship all items priority mail(2-3 day delivery), with the exception of books. We will ship book rate(5-7 day delivery), for all books, at the request of the winning bidder. We prefer Visa and Mastercard(via PAYPAL) and Money Order payments We make every effort to ship within 24 hours of receiving Mastercard, Visa, or Money Order Payment. We will accept personal checks with a 7-10 day waiting period for clearing. A $25.00 fee will be charged on all returned checks. NOTE: We ship to the UNITED STATES ONLY(including Hawaii and Alaska). We DO NOT ship internationally at this time. (We will not ship to Canada or Mexico). Payment I accept the following forms of payment: PayPal, Money Order, Personal Check. Additional Information Low cost image hosting and full service auction management solutions: AuctionWatch');
