riental Teas under the picture. All have the Chein Industries, Inc. 1977, 1978 on the bottom of one side in small print. They are copper brown in color and have pretty, old-fashion-like designs on the tops of them. They are in great condition. The winning bidder will pay $9.95 Shipping and Handling and $1.10 Insurance. Don''t miss out on this exceptionally nice Old Metal Canisters! To insure delivery before the Holidays, why not purchase them with the Buy it Now Option! HAPPY BIDDING !! Click on a picture to enlarge '') //-- '') //-- Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
