INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045754969, 1048, '1945 CAPTAIN MARVEL ADVENTURES #49 CGC Graded', 37.77, 0.1, null, 10, 'Hamilton, Ontario', null, null, 'Canada', '2001-12-08 15:45:09', '2001-12-15 15:45:09', 'Title: Captain Marvel Adventures Issue Number: #49 Publisher: Fawcett Publications. Date: October-November, 1945. Notes: Excellent Golden Age superhero comic. This attractive, problem free issue has been graded VG (4.0) by the CGC. It has off-white to white pages and easily could have come back VG+ or even VG/F. Overstreet prices are $35./$105./$280. A $70.00 value in this grade. Keep in mind the security of owning a CGC graded comic yet saving the $25.00 plus to get it done. Consider this a wonderful opportunity to add this classic to your collection. No reserve and a starting bid equal to the original cover price. Merry Christmas!!! Grade: CGC Graded VG (4.0) Unrestored Methods Of Payment; PayPal, Billpoint, BidPay, Money Order, Certified Check, Bank Draft, Personal Check Or Cash. Fixed Shipping Rates; Within Canada Or To The United States $8.00 , To Any Other World Destination $12.50 . Combined Shipping Policy; Comic book auctions won, may be combined in order to reduce overall shipping costs. A maximum of 7 days from the first auction won, to the final auction won can be combined before the outstanding balance is due. Regardless of the number of comics in any other auctions won, a flat rate of $1.50 per comic applies, after the initial fixed shipping rate for the first auction won, in determining combined shipping costs. Terms And Condition; Bids from bidders with a feedback rating of less than 10 with 1 or more negative feedbacks, will be cancelled. Please do not bid if you do not want to pay for the item. We have bought hundreds of items on e-Bay. The longest it has ever taken us to send payment is 2 days. We feel that 10 days is a very reasonable amount of time for us to receive payment. Have a look at some of the feedback comments left for us. You''ll see many talk about accurate grading, excellent packaging, quick shipping and professional service. We have been in the collectables industry for over 30 years . In May of 2000 we listed our first items for auction and made our first purchases on e-Bay. Since then we have accumulated 1,000 positive feedbacks from over 670 different dealers and customers. Give us a chance to show you why we have dozens of repeat buyers. Rest assured you can bid with complete confidence. Thank You...Good Luck and... Happy Bidding!!! ---------------------------------------- We are J.R. Canadian Currency In Business For Over 30 Years... ---------------------------------------- Payment I accept the following forms of payment: PayPal, Billpoint, Money Order, Personal Check, BidPay and Cash. Click image to view larger version Click image to view larger version Click image to view larger version Additional Information Low cost image hosting and full service auction management solutions: AuctionWatch');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045756299, 1059, 'Seven 19th Century Inks', 3.99, 3.99, null, 0, 'Bottle Country - Southeast Pennsylvania', null, null, 'USA', '2001-12-08 15:48:41', '2001-12-18 15:48:41', 'Here''s a group of 7 old inks, and all except #1 are from the 19th century with applied tops. These are dug bottles, and unless noted otherwise, each is structurally perfect but with various levels of stain to be cleaned up. From left to right, they are: Bottle #1 is a cylinder with an older screw top, 2 5/8" tall, clear. Bottle #2 is an amethyst-colored cylinder, crude and 2 5/8" tall. Bottle #3 is an aqua cone, 2 1/2" tall. Bottle #4 is a taller, 8-sided ink or mucilage with a shear top and a couple flakes around the top. Light amethyst colored. 3" tall. Bottle #5 is a faint aqua cone, 2 3/8" tall - has a couple lip chips. Bottle #6 is an light amethyst cylinder, 2 1/2" tall. Bottle #7 is a small size schoolhouse type square ink with beveled shoulders, 2 3/8" tall. TERMS: Satisfaction guaranteed - 10 day return policy. Only money orders and checks accepted in U.S. funds drawn from a U.S. bank. Buyer agrees to pay shipping, packaging and insurance costs of $7.50 by US Priority Mail (except exact S&I for orders shipped outside the U.S.). PA residents must include 6% sales tax. Please check out our direct sale bottles at bottleland.com Ruby Lane Antiques & Collectibles Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
