INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045764509, 1074, 'Dreamsicles: Rainbow Rider? - Large - No Box', 5.99, 5.99, null, 1, 'Hurst, TX', 32.858398, -97.17681, 'USA', '2001-12-08 16:10:10', '2001-12-15 16:10:10', 'Dreamsicles: Rainbow Rider? - Large - No Box 1994 - The Tag on the bottom is missing It has no chips, cracks and is in very good condition It has been on display and does not come with a box Size is 5 x 6 inches See Picture ============================================ PLEASE READ THE FOLLOWING BEFORE BIDDING: ============================================ We ONLY ship to United States addresses Sorry, but at this time, there is NO exceptions. If your "shipping address" is not within the US please, do not bid on this auction Winning bidder to pay for shipping & insurance (if desired) Please see the bottom of this listing for shipping & insurance costs We also adjust the shipping total for multiple auction winners Payment is expected within 10 days of the auction closing We accept personal checks, money orders eBay Payments, Paypal and BidPay ========================================= What you can expect from us after the auction ends: ========================================= Our Auctions end Saturday Night & you will receive a eBay Payment Invoice within 24 hours with your total. Our Mailing address is listed at the bottom of this listing for your convience or you can use eBay Checkout Your can also use the Paypal link as soon as the auction ends to pay, our account is: bobstoyz@hotmail.com ============================== Paying by eBay Payments, Paypal or Checkout ============================== If you pay, Saturday night or Sunday through Checkout, or Paypal your item will be shipped via USPS by the following Tuesday. ================================ If You Would Rather Pay by Check or MO: ================================ Please include a printed copy of this auction or your mailing address and Most Important, the eBay item # or it can delay shipping Please make check or MO out to: Bob Dennis Our Mailing Address: Bob Dennis Burleson Old Towne Collectables 536 W.Pipeline Rd. Hurst, TX 76053 Hope you win!! Bobstoyz NO RESERVE Buyer to pay $4.00 for shipping and handling. Insurance of $1.10 should also be included if desired. Click here to view my other auctions. Created by eBay Seller''s Assistant Pro');
