INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045770692, 1082, 'Lanam Co. Lid to fit Longaberger Envelope NEW', 13.99, 13.99, null, 1, 'Ohio - The Buckeye State!', 40.05991, -83.18299, 'USA', '2001-12-08 16:25:30', '2001-12-15 16:25:30', 'You are bidding on an oak lid made by the Lanam Company to fit the Longaberger Envelope Basket. This lid has never been used or displayed, stored in my smoke free home. It features laser engraving and hand painting and is just what you need to complete your basket. Buyer to pay actual shipping. I will accept money order, paypal or personal check but will hold until check clears. Over the next few days, I will be selling several baskets and lids from my personal collection. Most have never been used or displayed. Be sure to check my other auctions. Feel free to email me with questions. Thanks for lookig!');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045771355, 1084, 'Nabisco OREO Cookie Stacked Cookies Jar NR!!!', 9.95, 9.95, null, 0, 'Great State of, Kentucky', 37.81109, -85.46164, 'USA', '2001-12-08 16:26:02', '2001-12-15 16:26:02', '.titledata { font-family: verdana, sans-serif; font-size:17px; color:#ffffff; } .description { font-family: verdana, sans-serif; color:#FFFFFF; } .link { font-family: verdana, sans-serif; font-size:12px; underline; } HR { color: #ffffff; } Nabisco OREO Cookie Stacked Cookies Jar NR!!! Click image to view larger version Click image to view larger version Click image to view larger version Here is a wonderful Nabisco OREO Cookie Jar. Stands about 12 inches tall and features a stack of very large OREO Cookies with a comical Oreo Cookie with a face as the handle at the top. Part of the Nabisco Classics collection. Has two very small nicks in the back otherwise no cracks or crazing. If you have any questions, please email me before you bid as all sales are final and I want you to be happy with your purchase! Happy bidding! Buyer to pay actual shipping unless otherwise noted in auction description. Payments to be recieved within 10 days of close of auction. We happily take Paypal, Visa, MasterCard, Money Orders Cashier''s Checks and Personal Checks, from US buyers only. Internationala Buyers payments accepted via USD Money Order or Cash Only there will be a 10 day delay in shipping your item after receiving payment by personal check. This allows enough time for the check to clear the bank. There will be a $25.00 charge for any check returned unpaid. Payment I accept the following forms of payment: PayPal, Visa/Master Card, Discover, Money Order, Personal Check. Additional Information Low cost image hosting and full service auction management solutions: AuctionWatch');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045773325, 1085, 'OVERSTREET COMIC BOOK PRICE GUIDE #8 (1978)!!', 11.95, 11.95, null, 1, 'Prescott, Arizona', 34.706724, -112.39773, 'USA', '2001-12-08 16:29:40', '2001-12-15 16:29:40', 'This is The Official Overstreet Comic Book Price Guide #8 (condition VF/nm; softcover), published by Overstreet Publications, 1978!!! Contents include: Grading, Storage, How to Start Collecting, Collecting Back Issues, Buying and Selling, Conventions, History of Fandom, Fanzines, Collecting Strips, Collecting Original Art, price lists, and more!! WE SHIP WORLDWIDE!!! Write to ask for shipping rates outside the USA! (**WINNERS OF MULTIPLE AUCTIONS CAN COMBINE TO SAVE ON SHIPPING**) After you bid on this item, we want to see you bidding on other items from us. However, we realize that with all the auctions we run, it is hard to look through them and find what you might want. To help you out, we have come up with 4 different ways, not generally offered by eBay, to search our auctions . 1) Click here to search our other auctions alphabetically starting from A to Z (numbers come 1st) then the As, Bs, Cs, Ds, Es, etc.! 2) Click here to search our other auctions alphabetically starting from Z to A. In this order Zs, Ys, Xs, Ws, Vs, Us, etc.! 3) Click here to search our other auctions by lowest current price to highest current price, $3.95, $4.95, $5.95, etc.! 4) Click here to search our other auctions by items closing the soonest (this is less organized but you can get last minute deals easier here)! Good Luck Bidding!! Shipping Terms: High bidder pays either $2.50 Book Rate shipping (10-21 days for delivery) or $4.00 Priority shipping (3-5 days for delivery) To cover the cost of our packing materials and employee''s wages who pack the orders, all orders are subject to an 80_ handling fee. Insurance is an extra $1.10(per $50 of value) and is required on auctions closing above $25. If you choose no insurance and your package is lost or damaged, no refund is possible. We have been in business for 10 years so bid with confidence. Payment may be made with Pay-Pal (at our address of wantlist@cableone.net), with Money Order, Check, or directly with VISA, MASTERCARD, or DISCOVER. To pay by credit card directly please call us at (928)717-1030 and leave your name, item #, credit card #, expiration date, address, and telephone #. Please speak slow and clear as you have about 2 minutes to record this information. To pay by check or money order please send payment to: Randy Tusha P.O. Box 4224 Prescott, AZ 86302-4224 Payment must be received within 10 days of close of auction. Positive feedback will only be left for those paying promptly, and only after you have received your order and are satisfied. Negative feedback will be left for anyone who doesn''t pay! ***SPECIAL NOTE*** WE ARE CLOSED ON WEEKENDS! We contact all winners on Mon-Wed following the auctions. Randy & Michelle Tusha Hours: Monday - Friday 10:00 A.M to 6:00 P.M. Mountain Time (928)717-1030 Besides our normal 300-400 auctions per week: Click here to see our HIGHER DOLLAR items, listed on EBAY! Click here to e-mail us with questions about this or any other item we are listing on eBay!!');
