INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045776745, 1089, 'Vintage Mirro Cookie-Pastry Press W/Recipes', 26, 8.99, 113.32, 6, 'Northville, MI 48167', null, null, 'USA', '2001-12-08 16:35:38', '2001-12-15 16:35:38', 'Vintage Mirro Cookie-Pastry Press W/Recipes This is a vintage Mirro brand cookie-pastry press in the original box with recipes. You are getting the aluminum press, 12 cookie plates and 3 pastry tips, and an instruction/recipe book. This is in very good condition -- looks like it was never used. All the pieces fit down into a styrofoam base and there is a box bottom only -- I think a lid of some type is missing, but the base fits over the styrofoam. If you are planning to make holiday Spritz cookies -- this is just what you need! NO RESERVE! Buyer agrees by bidding to pay $5.20 for shipping in the U.S. Most likely, the shipping quote is priority mail through the USPS, but I also use first class, or media mail if appropriate. Insurance is optional at $1.10 for the first $50. coverage. If you opt to not have insurance it is understood that you are shipping at your own risk. If I have not given a quote above it is because this weighs more than 5 lbs. wrapped and the costs vary depending on where you live -- You can get an exact quote by going to the postal website at www.usps.gov -- my zip code is 48167. I cannot ship UPS. International rates will be higher -- write me for a quote before you bid if you are concerned about the cost. Bid on more than one item to save shipping costs!! ALL THE FINE PRINT: Personal checks, money orders, PayPal, Billpoint or Bidpay are accepted. I make every effort to ship as soon as possible with any type of payment. Since I list a wide variety of collectibles, I can''t be an expert on everything. I do try to be as accurate as possible in my item descriptions, but I may inadvertently leave out some information because I''m not that familiar with a particular piece. If you have any questions, please feel free to e-mail me. Thank you for looking!! Michigan residents must pay 6% sales tax or provide me with your tax ID#. Pay me securely with your Visa or MasterCard through PayPal! function dw(nu){document.write(s1+"ppsl"+nu+".gif"+s2+sA[nu]);}f1="document.links";s1="\\ ","\\"Winning bidder, click here to pay instantly by credit card!\\"\\","\\"Winning bidder, click here to pay instantly by credit card!\\"\\");c1=c2=c3=c4=0;for(i=0;i =0){c1++;}else if((eval(f1+"["+i+"].search")).indexOf("BetterSeller")=0){c2++;}else if((eval(f1+"["+i+"].search")).indexOf("ListItemForSaleShow")=0){c3++;}else if((eval(f1+"["+i+"].hash")).indexOf("ListItemForSaleAutosShow")=0){c4++;}}if((c1=2)||(c20)||(c30)||(c40)){dw(3);}else{dw(2);}f11="xclick-auction";f13="iid=";f14="";for(i=0;i 0){s11=document.links[i].search;j=s11.indexOf(f13);if(j0){s11=s11.slice((j+(f13.length)));for(k=0;k =0){var p=new Array();p[0]=document.links[i].protocol;p[1]=document.links[i].hostname;p[2]=document.links[i].pathname;for(j=0;j Free counters provided by Honesty.com This listing created by eBay Seller''s Assistant Basic. Payment Details U.S. Shipping and Handling $6.30 Shipping Insurance per item - Sales Tax (6.000% if shipped to MI) _ Learn more about checkout Payment Instructions If the shipping amount is listed as $1.10 only, that is just the insurance. It is because this weighs more than 5 lbs. wrapped. I will need to calculate the shipping cost based on your address. Returns allowed if item not as listed.');
