ders, all orders are subject to an 80_ handling fee. Insurance is an extra $1.10(per $50 of value) and is required on auctions closing above $25. If you choose no insurance and your package is lost or damaged, no refund is possible. We have been in business for 10 years so bid with confidence. Payment may be made with Pay-Pal (at our address of wantlist@cableone.net), with Money Order, Check, or directly with VISA, MASTERCARD, or DISCOVER. To pay by credit card directly please call us at (928)717-1030 and leave your name, item #, credit card #, expiration date, address, and telephone #. Please speak slow and clear as you have about 2 minutes to record this information. To pay by check or money order please send payment to: Randy Tusha P.O. Box 4224 Prescott, AZ 86302-4224 Payment must be received within 10 days of close of auction. Positive feedback will only be left for those paying promptly, and only after you have received your order and are satisfied. Negative feedback will be left for anyone who doesn''t pay! ***SPECIAL NOTE*** WE ARE CLOSED ON WEEKENDS! We contact all winners on Mon-Wed following the auctions. Randy & Michelle Tusha Hours: Monday - Friday 10:00 A.M to 6:00 P.M. Mountain Time (928)717-1030 Besides our normal 300-400 auctions per week: Click here to see our HIGHER DOLLAR items, listed on EBAY! Click here to e-mail us with questions about this or any other item we are listing on eBay!!');
