INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045874211, 1293, 'HARMONY KINGDOM ~ ARIA AMOROSA ~ RETIRED', 1.25, 1, null, 2, 'Portland, OR', 45.580557, -122.374776, 'USA', '2001-12-08 19:19:40', '2001-12-15 19:19:40', 'HARMONY KINGDOM ~ ARIA AMOROSA ~ RETIRED Name: Aria Amorosa Artist: Peter Calvesbert Item No: TJES Collection Name: Treasure Jest Subset Name: Small Treasure Jest Exclusive To: Made In: England Status: Retired Carving Date: 1997 Release Date: 1/1/1998 In Store Date: Retirement Date: 7/1/1998 Edition Size: 9530 US Issue Price in USD: $45 UK Issue Price in GBP: 29.5 CAN Issue Price in CND: $70 Category: Box Figurine Dimensions (Inches): 1.93 x 2.83 x 2.95 S e c r e t s This box figurine depicts two seals, lovingly entwined, mouths open in song. A plimsol line with numerical markings runs down the belly of one of them, a representation of the amount of oil that can be extracted from an elephant seal. Peter carved the cigarette lighter under the other seal s flipper after a beach-combing trip in North Wales where he found the beach littered with plastic lighters. Peter s mouse looks out startled from under another flipper. The inspiration for the rat carved inside was a topical news item that Peter misheard on the radio at the time of carving: the monster rat catastrophe. It turns out that it was the Montserrat catastrophe, a volcano threatening to erupt in the Caribbean. Hallmarks include , heart, HBC logo, ed.#, and Pc, with "P. Calvesbert" on the base. 1ST EDITION, NEVER DISPLAYED. THIS BOX WAS FROM THE FIRST RELEASE AND THE NOSE OF THE MOUSE INSIDE IS RED. THE FLIPPERS OF THE SEA LION ARE GREY. ARIA AMOROSE HAS NEVER BEEN DISPLAYED AND IS IN PRISTINE CONDITION, . SHIPPING, HANDLING AND INSURANCE, $7.00. ALL MY AUCTIONS YIELD NOTHING BUT THE BEST! GOOD LUCK!! This listing created by eBay Seller''s Assistant Basic. Free Honesty Counters powered by Andale! Visit Suncookie today! Payment Details U.S. Shipping and Handling $5.50 Shipping Insurance per item (optional) $1.50 Sales Tax (none) _ Learn more about checkout Payment Instructions See item description or contact seller for more information.');
