INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045908587, 1351, 'NM 1970 ASTONISHING TALES #1 - 8 KAZAR & DOOM', 30.99, 9.99, null, 6, 'Akron, OH', 41.128705, -81.53999, 'USA', '2001-12-08 20:07:35', '2001-12-15 20:07:35', 'P { color: black; font-size: 12pt } FONT.F00 { font-size: 15pt; font-family: "Arial Black" } FONT.F01 { color: #800000; font-family: "Arial Black" } FONT.F02 { font-size: 10pt; color: #FF0000; font-family: "Arial" } FONT.F03 { font-size: 24pt; color: #0040C0; font-family: "Arial Black" } FONT.F04 { color: #0040C0; font-family: "Arial Black" } FONT.F05 { color: #008000; font-family: "Arial" } FONT.F06 { font-size: 12pt; color: #008000; font-family: "Arial" } FONT.F07 { font-size: 10pt; color: #0000FF; font-family: "Arial" } FONT.F08 { font-size: 10pt; color: #800000; font-family: "Arial" } FONT.F09 { color: #0040C0; font-family: "Arial" } FONT.F0a { color: #FF0000; font-family: "Arial" } FONT.F0b { font-family: "Arial" } FONT.F0c { color: #0000FF; font-family: "Arial" } FONT.F0d { font-size: 15pt; font-family: "Arial" } FONT.F0e { font-size: 15pt; color: #0000FF; font-family: "Arial" } BODY { background: #FFFFFF } SELLING INFO IN THIS COLUMN ITEM INFO IN THIS COLUMN I''M OUT ON MY OWN... I built up a 550+ feedback rating while working with Socko! Comics. Now I am starting over on my own, but that means starting with a feedback of zero. Read my Honesty Policy below. NM 1970 ASTONISHING TALES 1 - 8 : KAZAR & DR DOOM QUESTIONS: click here to send an e-mail CONDITION : NEAR MINT OPENING BID: $9.99 HOW TO PAY? MONEY ORDER & PAYPAL HOW TO SHIP? I ship via United States Postal Service for both domestic and international. You pay only the cost required to ship. I do not believe in padding auctions by adding unjustified extra charges. I don''t like it when people do it to me, so I won''t do it to you. PICTURES: Click on each to get a larger view. _ #1 #7 HONESTY POLICY I have met people in my store who won books on E-Bay that were nowhere near the condition described. It angers me as a seller because it ruins the reputations of dealers as a whole. Simply put, it hurts our market by driving away customers. How Do I Grade? I look at every book and grade it according to six categories: front cover, back cover, corners, edges, spine & staples, interior pages. I give a complete description of each of these sections noting any flaws or defects. Also, I include large scans of the front and back covers. When I have completed the auction page, I am satisfied that you know exactly what you are bidding on and that there will be no surprises at auction''s end. So what about returns? At first I offered returns on books. Then I quickly discovered that some people would outbid everyone else by an excessively high amount just to get a look at the book, then ask for a return if they decided they didn''t want it. I no longer offer returns. I am confident in my grading and description and have never had a complaint about either. If you are not sure that you want the book then don''t bid on it. COMPLETE DESCRIPTION: _ All books have come from the same collection and have received the same care over the years. Title: Astonishing Tales Featuring Kazar and Dr. Doom Issue(s) & Date(s): #1, August 1970 - #8, October 1971 Double feature books. Issues feature work by Kirby, Wood and Barry Smith. Appearances by Black Panther, Kraven, Nixon & Red Skull. This run represents the first Mavel Villain solo series. Front Cover: Strong gloss, bright color, clean white. No tears, creases or fading. Back Cover: Strong gloss, bright color, white. No tears, creases or fading. Corners: Sharp with minimal to no wear. Minor crease wear at lower right corner of issue #4. Wear at upper and lower left corners of issue #8. Edges: Sharp, clear definition. Spine & Staples: Strong, straight and clean. A few crease lines near bottom staple of issue #4. Minor wear along spine edge of issue #8. Interior Pages: White. Strong, bright color. The books come bagged and boarded. Check out our other auctions for more great books! MORE QUESTIONS? CLICK BELOW TO SEND AN E-MAIL: I HAVE A QUESTION! _ Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
