INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045946837, 1417, 'AREA 52 1, 2, 3 & 4 sci-fi x-files paranormal', 7.5, 6.5, null, 2, 'Southern Alberta', null, null, 'Canada', '2001-12-08 21:25:50', '2001-12-15 21:25:50', 'ABOUT ME PAGE ___- _ CHECK OUT OUR OTHER AUCTIONS! ATTENTION:_ Please e-mail us with all questions before placing a bid._ If there is any difference between the_Listing Title and the Description, please let us know immediately. _ IMAGE COMICS _ AREA 52 #1, 2, 3 & 4 OF 4 _ EVER HEAR OF AREA 51....THIS STORY IS ABOUT AREA 52, WHERE THEY STORE STUFF FOUND IN AREA 51 AND OTHER POWERFUL ARTIFACTS._ SORT OF A CROSS BETWEEN THE X-FILES AND RAIDERS OF THE LOST ARK._ _ EXCELLENT ART.....GREAT STORY! _ HABERLIN - HENRY - HANNIN _ __ ALL OUR ITEMS ARE MINT/NEAR MINT and IN ORIGINAL PACKAGING, UNLESS OTHERWISE NOTED.__ _ AS PICTURED BELOW. CHECK OUT OUR OTHER AUCTIONS! CHECK OUT OUR EBAY INFORMATION PAGE! _ ==ACTUAL SHIPPING COSTS WILL APPLY== ==SAVE ON SHIPPING COSTS BY COMBINING MORE THAN ONE ITEM== OUR_ EBAY BUYER POLICIES: 1._ All of our auction items are in m/nm condition unless otherwise stated. Some of our items_have shelf wear or shipping damage on the packaging of varying degrees._ Please inquire if you would like a more_detailed description of the condition of the packaging before you place a bid. _ 2._ eBay is not a perfect system._ It is the Buyers responsiblity to contact us with any and all questions before bidding on the auction._ DO NOT wait until you have already placed a bid or, worse yet, after the auction has ended._ By bidding you are agreeing to the terms of eBay and this policy. _ 3._ The Buyer is responsible to contact me ASAP if there is any_difference between the Auction Title and the Description or if there is uncertainty about the item being auctioned. _ 4.__The winning buyer is responsible for Actual Shipping Charges, whatever they may be, when the auction is completed._ Actual Shipping charges include_the Cost to Ship plus a US$0.65 Handling fee to cover the cost of shipping materials & supplies. _ _ 5._ Payment must be received within 17 days after the auction ends._ Failure to do so will result in a non-paying bidder alert and possible further action. We accept the following methods of payment:_ Buyer Initiated Paypal ( www.paypal.com ), Buyer Initiated BidPay ( www.Bidpay.com ), Money Order, Cash, or Check up to US$25.00 (US & International Checks up to 25 days). SORRY, WE NO LONGER ACCEPT_DIRECT CREDIT CARD PURCHASES. _ _ 6._ When an auction ends, the high bidder will usually be contacted within 24 hours._ However, please allow up to 48 hours if required. If, for whatever reason, you did not receive the confirmation message within 48 hours, please contact me immediately. _ _ 7._ Packages will generally be shipped within 24 hours after the receipt of payment, or on the first working day of the week if the auction ended on a weekend or holiday. _ 8._ When the auction has completed, please send us your Name & Mailing Address for our records. _ 9._ Canadian Buyers will be required to pay an additional 7% GST on all items. DEADBEAT BIDDERS DON''T EVEN TRY! FAILURE TO MAKE PAYMENT WITHIN 15 DAYS MAY RESULT IN NEGATIVE FEEDBACK! Any questions? Just ask... requests@leftofreality.com Content Copyright 1999-2002, Me & Max/Just a Little Left of Reality _');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045947231, 1420, 'M. Engelbreit Gingerbread Tea Pot Miniature', 6, 6, null, 0, 'NJ', 40.830733, -73.97334, 'USA', '2001-12-08 21:27:19', '2001-12-15 21:27:19', 'Decorative Mary Engelbreit Tea Pot Design Miniature/ Ornament.THIS AUCTION IS FOR STYLE #1 ONLY (see photo)....Very cute & colorful gingerbread design.Ornaments measure approximately 2 inches in diameter,satin cord for hanging.Bright & colorful designs.Great for decorating windowsills,cabinets,packages,and a wonderful idea for any collector!Great for the upcoming holiday season!Collect them all.Gift boxed.Buyer pays $3.95 for S&H.Here are a few of my policies:(1) NJ Residents please add 6% sales tax to final auction price.(2)Payment is expected within 14 days after auction ends.(3)MONEY ORDERS will ship your package the next day upon receipt,CHECKS will hold the shipping of your package 7-10 days until check clears the bank.PAY PAL ships your package within 48 hours.(4)Postal insurance is optional, but STRONGLY SUGGESTED especially for any fragile items such as FIESTA, porcelain figures,ANYTHING that could possibly break during shipping.I take extra time & carefully wrap all items,unfortunately accidents do occur during shipping.If you choose not to insure an item, I take no responsibility for lost/damaged items. I do not give refunds on any insured/uninsured items that are lost/damaged during shipping.All refunds for insured items come directly from the US Postal Service. I will assist in any way I can w/receipts,ect.(5) I will gladly ship winning auctions together to save on shipping.(6) Finally,I ask you email when you receive your package & I will know our transaction is complete. At that time, I will post positive feedback. Please email with any questions & Thanks for looking!!!');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045947680, 1421, 'Kriss Kross Safety Razor Blade Stropper RARE', 3, 3, null, 0, 'Northeast PA', null, null, 'USA', '2001-12-08 21:29:03', '2001-12-15 21:29:03', 'This rare safety blade strop comes with the original box marked "Rhodes Kriss Kross Safety Blade Stropper. Price six dollars. Sold by Rhodes Mfg. Co., St. Louis". The box is in good shape. Still strong with no split corners. The strop itself is a remarkedly well designed machine. There is a sliding lock handle on the blade holder and a fold over cranking handle. The blade holder flips over as the handle is cranked to strop both sides of the blade. The body of the machine is marked on top and bottom similar to the printing on the box. Patent numbers are on the bottom dating from June 1921 to January 1927. Although used, it will clean up nicely. Shipping/handling is $3.90. I accept money orders, Billpoint or PayPal. Will ship within one day of receipt of payment. Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045950242, 1422, 'Hallmark 2000 Baby''s First Christmas Bear trn', 8.99, 8.99, null, 0, 'Brownsburg, Indiana', 39.84952, -86.38739, 'USA', '2001-12-08 21:36:54', '2001-12-15 21:36:54', 'This is a mint in mint box, never displayed ornament of the Baby''s First Christmas, dated 2000. It is that really cute bear asleep on the train, and is part of a series you can buy in the following years (Hallmark has the new ornaments out for 2001, so you can get baby''s second christmas 2001 which is another bear in a train car) Let me know if you have any questions! This is part of the Child''s Age Collection. It has never been removed from the box. Buyer pays shipping of $3.95 priority. I have a huge list of Hallmark ornaments I can email to you if you want to add to this order. Just let me know. I have many Disney ornaments by Hallmark. I take personal checks, money orders, cashiers checks, and PayPal. Thanks for looking! Check out other auctions of mine. I can ship up to four ornaments for the same shipping price. If you pay by personal check and your feedback rating is below 15, I will hold the item for a week before I ship it to you. If you pay by money order, cashiers check, or PayPal, I will ship to you right away! If you pay by PayPal, please email me first. I would prefer you send the PayPal funds to a different account of mine to avoid the fees. If you want to sign up with paypal and you use me (jennifer_hagerman@hotmail.com) as a reference, both you and I will get $5 when you sign up for their free service. Email me with any questions you may have! I will also ship to FPO and APO addresses. Be sure to check out my other auctions. I will gladly combine shipping. Additional ornaments do not increase the price of shipping. Good luck and happy bidding!');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045950557, 1423, 'We 3 Kings of Orient Set Fitz & Floyd 1976', 5.95, 5.95, null, 0, 'Navy Parents & Proud Of It!! Texas', null, null, 'USA', '2001-12-08 21:38:02', '2001-12-15 21:38:02', '"We Three Kings" by Fitz and Floyd. Great, crisp, clean vintage 1976 Fitz and Floyd set of the three kings done in a white-on-white motif. If one wished to, I am sure small pillar candles could be placed in the crowns. My opinion? Just display them! The set features three different designs for face and crown. Each piece is 4 inches wide and 4.5 inches in height. All pieces are ink stamped "Fitz and Floyd Inc. MCMLXXVI" (1976). This was a great vintage find on several fronts _ finding the entire set and finding each piece in pristine condition without any sign of nicks, chips, cracks or flakes. Thanks for your time and interest. Love Our Country _ Support Our Military Winning bidder should acknowledge notifying email within 3 days. Priority Mail Shipping (in the Continental US only) will be $6.85. If insurance is desired, please add $1.10. International Bidders: Please email for estimated shipping/insurance fees prior to bidding. Payment accepted in US dollars only via International Money Order, Cashiers Check, PayPal or BidPay. Payments via PayPal or Money Order will ship as quick as we can get your purchase wrapped, packed and to the PO and/or UPS. Personal Checks are fine but will require seven business days to clear prior to shipment.');
