INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045954573, 1427, 'Vintage Wild Bill Elliot Comic Book 1955', 2.95, 2.95, null, 1, 'Washington state', 47.751471, -122.20257, 'USA', '2001-12-08 21:54:27', '2001-12-18 21:54:27', 'Vintage Wild Bill Elliot Comic Book 1955 This Rare "Wild Bill Elliot" comic book No.643 was published quarterly by Dell Publishing Co. The copyright is 1955 by Stephen Slesinger. It has 34 pages with two stories and many color illustrations. A partial listing of the contents follows: On the cover are "Famous Knots You Can Tie" like a "Square Knot" -- "Lariat Loop" -- "Sheepshank" -- "Bowline" Inside the front cover is an article with an illustration showing the "Distinguished Achievement Award presented to Mr. George T. Delacorte, Jr. by Newsdealers Post Number 1169 American Legion on November 14, 1954. Wild Bill Elliot in: "Mystery of Furnace Valley" -- 17 pages Wild Bill Elliot in: "Peril at Sundown" -- 17 pages This vintage Wild Bill Elliot comic book is in good condition. There are some tiny light brown spots on the covers. Other than that, there are No rips or tears. The binding is tight and the pages are white. These collector''s comics are getting harder to find, as many were lost or badly damaged over the years. This vintage Wild Bill Elliot comic will be a nice addition to your western comic collection. Winning bidder pays $1.60 for First-Class shipping. Payment is expected within ten days after auction closes. Be the winning bidder on my other auctions and save on shipping costs. As a bonus, 2 pocketsize Christian calendars are sent with the first order. Note to foreign bidders: I accept BidPay, Paypal, US currency and money orders drawn on US financial institutions (ie. American Express) only. Postage will be determined by destination. Thanks for looking and remember: Wise Men Still Seek Him NO RESERVE Buyer to pay shipping/handling and insurance if desired. Money Orders and PayPal payments will insure next day shipping. Checks will be held up to 10 days for clearance, unless buyer has 20 postive feedbacks and no negative. Hourly Statistics by Ruby Lane Created by eBay Seller''s Assistant Basic. Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
