INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1045984485, 1453, 'HULK 111-200 (29 issues) VF/NM Very Nice!!', 66, 60, null, 2, 'home', null, null, 'USA', '2001-12-09 01:42:33', '2001-12-16 01:42:33', 'You''re bidding on a VERY NICE run of ol'' Greenskin. Included are issues: 111,112,116,123,124,126,127,128,129,130,131,133,134,136,137,140,141,142,143,145,146,148,149,151,152,153,155, and #200.. Plus Incredible Hulk Special #4. All are in BEAUTIFUL condition.. really nice comics. The only exception to this would be Issue # 200 which has some dark scuffing amidst the white background. Amazing the newest one is the worst.. and even it''s prob at least a Fine grade comic. I believe issue 141 is the first appearance of Doc Samson.. saw it on here for about $50 all by itself and prob not as good as this one.. It looks about perfect to me. Issues 123,124,129,130, and 131 have store date stamps on the light part of the covers.. but nothing major.. other than that they appear to be NM. It would take me forever to look at each and every page of this many comics but the few I opened and checked only showed to be a little off-white around the edges.. and near the center. Nothing out of the ordinary for a 30 year old comic. Saw no creases or any other obvious blemishes.. other than those with the store dates. All are bagged and boarded.. and rather than risk damaging them in scans I chose to scan them in the covers so if you see a little "shimmer" .. it''s the scan... not the comic. I really don''t think you''ll be dissapointed in any way with the condition of these comics. If so just tell me within 3 days and I''ll refund your money.. minus shipping. I think that''s a fair proposition. Trying to describe these as best I can so you''ll know what you''re getting before you bid. I haven''t researched anything as to their true value.. I''ll leave it to some savy bidders to do the research and bid accordingly. I''ll start the bidding at $60 which I believe is a steal for this quality and quantity. I hate to set any limits at all but I feel 2 dollars a book is a pretty good buy.Sentimentally they''re worth a lot more to me.. a part of my youth I held on to for all these years. You probably can''t get that many brand new comics at that price. Much less true collector items. Anyways.. that''s the deal. Hope you like what you see. Will accept PayPal, Money Orders, and Cashiers Check. Shipping will be a flat 7 dollars which will include: Well packed USPS Priority Shipping, Tracking # and insurance covering the total bid price. May cost more to do all this.. will be a fairly heavy package but I lean towards the buyer when it comes to shipping charges. I''m a buyer myself :) Thanks for looking and HAVE A VERY MERRY CHRISTMAS!! Click on a picture to enlarge '') //-- Supersize Picture '') //-- Supersize Picture '') //-- Supersize Picture '') //-- Supersize Picture '') //-- Supersize Picture '') //-- Supersize Picture Free Honesty Counters powered by Andale! Payment Details U.S. Shipping and Handling $7.00 Shipping Insurance per item - Sales Tax (0.000% if shipped to none) _ Learn more about checkout Payment Instructions Satisfaction Guaranteed or a full refund minus shipping.. Order will be totally insured up to the full value of the winning bid regardless of the cost to me. $7.00 shipping/Insurance, Sent USPS Priority mail with tracking #. Customer comes first!!');
