INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046006155, 1482, 'CALICO KITTENS NAP ANYWHERE NEW!', 5.95, 5.95, null, 0, 'Tammy''s Treasures Wisconsin', null, null, 'USA', '2001-12-09 05:03:15', '2001-12-14 05:03:15', 'CALICO KITTENS NAP ANYWHERE NEW! Description Calico Kittens. These are put out by the Enesco Corporation. The quality of these is excellent, and they are highly collectable. This one is called, "Nap Anywhere". This is a gold and yellow stripped kitten. He is taking a nap on a stack of books and papers. There is a mug with coffee behind him as well. On the red book under him it says Nap Anywhere. These adorable kittens are designed by Priscilla Hillman. The date on the bottom of it is 1999. It is numbered on the bottom of the figurine. It will come in the original box along with the registration paper so you can register your new piece. It is NEW, and in MINT condition. This piece would fit in nicely with your collection. It also makes a great gift. Payment and Shipping The lucky high bidder pays $5.00 for shipping, handling, delivery confirmation, and guaranteed shipping for USA domestic orders. Guaranteed shipping is explained below. Shipping for Canada will be extra, and payments from Canada must be in US funds. Checks are accepted, but will delay shipment of your item(s) for 7 to 10 business days for it to clear. Other payments accepted are, Cashiers check(s), Money order(s) and PayPal. All shipments within the state of Wisconsin are subject to 5% sales tax. Please take a look at my other auctions and storefront items to save on shipping. After the auction PLEASE DO NOT USE eBay''S CHECKOUT (which will appear on this auction page) I will send you an email notification and link to my own checkout page where you will be able to enter all your information and select your payment method. Please DO NOT use eBay''s checkout it does not include all the information you need and will result in you having to do additional work. Please wait for my email. Thank you. PLEASE READ BEFORE BIDDING PAYMENTS Payments are to be made within 10 days of the end of auction. If payment is not recieved within that time, I reserve the right to relist this item. If you win this auction, PLEASE go through my "Click-Out", so you can creat an invoice. This is very important for me and you. I also use it to get your address and payment information. A link to the "Click-Out" will be on the bottom of your winners notification if you are the winner of the auction. Please wait to pay for your auction(s) until all of the items you are bidding on are over so my "Click-Out" can total all of the items you win from me, and adjust the shipping costs. GUARANTEED SHIPPING This means that if you recieve a broken item(s), or your item(s) is lost in the mail, I will replace the item(s) after proof of damage. If I don''t have any more of the item(s) that are damaged or lost, I will refund your money, including shipping costs. SATISFACTION GUARANTEE If you are not satisfied with your item(s), you can return it/them, in the same condition as I sent them, for a refund less the shipping costs. Thanks for looking and Good Luck! Learn More About TAMMY''s TREASURES Click Here To EMAIL ME eBay''s most successful sellers use Auctionworks sales management services! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Please read the auction terms regarding the use of eBay Checkout');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046008070, 1483, 'Dreamsicles Angel Hugs ~ SANTA', 6.99, 6.99, null, 0, 'Oak Grove, MO', 38.99535, -94.14225, 'USA', '2001-12-09 05:10:11', '2001-12-16 05:10:11', 'Dreamsicles Angel Hugs ~ SANTA Description This is a gorgeous little Angel Hug - Great way to show someone you care. Brand new for 2000. If you purchase THREE or more of the Angel Hugs from us, shipping will be FREE! So, please be sure to check them all out!! Great prices, too! Be sure to check out our payment/shipping terms. By bidding, you agree to them. Thanks :o) Payment and Shipping Terms Buyer to pay $4.00 shipping and handling for this item. Payment methods accepted: Personal Checks, Money Orders, Paypal, MasterCard, Visa and Discover. All shipping info below - please make sure you understand all the shipping/payment info before bidding or purchasing so that there are no misunderstandings. I want my customers to be happy :o) Shipping above is stated for US shipments only. For each additional item, shipping is $0.50. Canadian Shipping is $4.25, with each additional item shipping being $0.75. Other International Shipping is $6.00, with each additional item shipping being $1.00. Email if you have any additional questions. INSURANCE: Insurance is at the buyer''s expense - and is optional. We charge flat USPS Insurance rates. If you are international, we HIGHLY stress paying the additional for shipping insurance since international shipments are more prone to being lost. I do not take any responsibility if items are lost or damaged in the mail if the customer does not choose to purchase the shipping insurance. I know the insurance is high - especialy for low-cost items. But the decision is totally up to the buyer. Slight Shipping Delay Shipping Status: 11/21/2001: Due to the fact we are in the midst of the holiday season - and I have taken on additional employment to supplement our family''s income, please note - we are currently running 1-3 weeks on shipping. I will try to ensure that I ship your item as soon as I possibly can. I just wanted you to be aware of our shipping status in advance. But due to Christmas coming up, any payment received prior to December 16th, 2001 will ship by December 17, 2001 - to hopefully arrive before the holidays. But I cannot guarantee holiday delivery due to the post office not guaranteeing delivery. Thanks :o) ~Christy~ The fine print: If for some reason, the item that you have purchased is out of stock, we will send you an email immediately upon receiving your payment informing you of the estimated shipping date. We try to ensure our inventory numbers are correct before placing an item on Ebay, Yahoo, Amazon or Ubid, but due to the fact that we use several online shopping services and also sell via our own store and webstore, sometimes we sell an item that turns out to not be in stock. You could at that time decide to cancel the order and a full refund would be issued. Otherwise, the order will ship out on the estimated shipping date provided in email. We are a family business located in Missouri. We have been in business for 4 years. We strive to provide the most unique and high quality merchandise possible!! If you cannot reach me by email, please feel free to call me if you have any questions 816-690-7023 (10am-5pm CST). eBay''s most successful sellers use Auctionworks sales management services!');
