arn more . If you win this item you will receive an item of value for your payment, so you should assume that you will not receive any charitable deduction. If you want to contribute separately, please go to Auction for America: Cash Donations . Your bid is a contract - Place a bid only if you''re serious about buying the item. If you are the winning bidder, you will enter into a legally binding contract to purchase the item from the seller. How to Bid on Charity Auctions 1. Register to bid - if you haven''t already. It''s free! 2. Learn about this seller - read feedback comments left by others. 3. Know the details 100% of your payment for the item will be forwarded to charity. The total payment may also include reimbursement to the seller for shipping and handling costs. 4. If you have questions - contact the seller prof_wessels before you bid. 5. Place your bid! 6. Simply pay using eBay Online Payments by Billpoint. This will help ensure that all proceeds go to charity. eBay purchases are insured . Top Questions From This Page How do I place a proxy bid? It looks like I can only place a maximum bid. Why doesn''t my bid show up? What does "reserve not yet met" mean? How can I change something or cancel my listing completely? Why isn''t my picture showing up? As a seller, how can I cancel an unwanted bid? Why does my email address appear when I have a User ID? How do I register? What is Half.com? Announcements __|__ Register __|__ SafeHarbor (Rules & Safety) __|__ Feedback Forum __|__ About eBay Copyright _ 1995-2001 eBay Inc. All Rights Reserved. Designated trademarks and brands are the property of their respective owners. Use of this Web site constitutes acceptance of the eBay User Agreement and Privacy Policy .');
