INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046087736, 1564, '1963 Bing & Grondahl CHRISTMAS PLATE w/BOX', 12.5, 1, null, 4, 'Los Angeles, CA', 34.175205, -118.382212, 'USA', '2001-12-09 09:38:26', '2001-12-14 09:38:26', '1963 Bing & Grondahl Christmas Plate In Mint Condition! The Christmas Plate or "Juleplatte" stems from an ancient Danish Tradition, transformed into fine porcelain by Harald Bing in 1895. Originally, the Christmas Plates were a gesture of thanks presented by Danish Nobility to their servants at Christmas time. It was the thought of immortalizing this "gesture of thanks" in fine porcelain that has given the world a beautiful symbol of Christmas Spirit as well as the wonderful hobby of plate collecting, enjoyed by millions today. The Motif of this plates is "The Christmas Elf ". Designed by Henry Thelander. Size: 7" -_ 18 cm. Very Rare. No Reserve. Mint Condition. Buyer to pay $8.00 for domestic shipping and insurance (unlimited items). Check out our other offerings on eBay! or contact us at henrik@GeolinOnline.com for further questions. Payment Details U.S. Shipping and Handling $8.00 Shipping Insurance per item - Sales Tax (none) _ Learn more about checkout Payment Instructions n/a');
