INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046115835, 1626, '1,000/Thousand Faces Jewelled Snuff Bottle!', 14.99, 14.99, null, 0, 'Florida', 29.968926, -82.122553, 'USA', '2001-12-09 10:41:02', '2001-12-16 10:41:02', '.titledata { font-family: verdana, sans-serif; font-size:18px; color:#FC1230; } .description { font-family: verdana, sans-serif; color:#000000; } .link { font-family: verdana, sans-serif; font-size:12px; underline; } HR { color: #000000; } 1,000/Thousand Faces Jewelled Snuff Bottle! _ _ _ Up for your viewing pleasure and discernment is this absolutley wonderful vintage?? 1,000/Thousand Faces jewelled snuff bottle, ornately carved into a walnut shell! Exact age of this item is unknown to me. The jewelled top is a cabachon of unknown type to me, has a deep, rich amber color to it with silver colored filigree trim aroung the edge! The spoon is also silver colored. This unusual item would make a great Christmas gift, or would be a fantastic addition to your own snuff bottle collection! Buyer to pay $4.60 Priority Mail shipping/ins. There may be a small handling fee added provided an item requires special handling or care in packaging. I will combine multiple items to save on shipping! I will ship internationally, however the bidder MUST have a good command of English language, and there will be a $5.00 international surcharge on any items under $50, no exceptions. Canadian bidders: Please realize that your bid is international and expect to pay postage accordingly. Payment MUST be postmarked within 5 days of close of auction. Checks take 7 days to clear, M.O. ships within a day or two of receipt, and we accept major credit cards through Billpoint and Paypal. Please e-mail with questions before bidding, as all sales are considered final, and we check mail regularly. Good luck, happy bidding, and thanks for looking!_ Payment I accept the following forms of payment: PayPal, Billpoint, Money Order, Personal Check, Billpoint. Low cost image hosting and full service auction management solutions: AuctionWatch Payment Details U.S. Shipping and Handling $0.00 Shipping Insurance per item - Sales Tax (0.000% if shipped to none) _ Learn more about checkout Payment Instructions Please wait for the end of auction e-mail with further instructions, as your item may require a special handling fee.');
