INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046145504, 1691, 'WINTERHALTER HOFMEIER BRACKET CLOCK-1/4 hr.', 405, 25, 668.58, 9, 'Northwest Indiana', null, null, 'USA', '2001-12-09 11:40:57', '2001-12-16 11:40:57', 'This is a high quality 1/4 hour chime bracket clock. This is a Lancet style or English Gothic Bracket clock. It is in excellent running order. The heavy movement has thick plates. The BIMBAM movement, chimes once on the quarter, twice on the 1/2 hour and 3 times on the 3/4 hour on two large gongs. It strikes the hour on one gong. It has a beautiful resounding tone. The silver dial has WHEATLEY above the center hole and CARLISLE under the center hole. The bezel has heavy beveled glass. The dial has a fast/slow adjustment at the top of the dial. This beautiful clock has string inlay edging the clock with accents in front and sides. The handles on the sides are especially pretty. The feet are typical bracket style feet. The pendulum is very heavy. It also comes with a old key. The markings on the movement(just in case my picture doesn''t come thru) is W & H and under that is SCH and under that is stamped 2. Please look at our pictures and email any questions. Our reserve is $550. for this excellent clock. Shipping in the U.S. is $40.00. Thanks for looking! God Bless America!');
