INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046214042, 1803, 'EC Comics MAD #37 ERNIE KOVACS NR', 4.99, 4.99, null, 1, 'MI', 42.824095, -82.66522, 'USA', '2001-12-09 13:52:47', '2001-12-16 13:52:47', 'This is EC Publications MAD MAGAZINE #37, 1958. See and read where it all began, years ago, and find that the humor still holds up today. Front cover is in very nice shape, minor signs of wear toward lower part of spine. Among other stories, a nice send up of ERNIE KOVACS "STRANGELY BELIEVE IT parts I and II," and other lunacy...... also a story with comedians BOB AND RAY.... If you are a EC or MAD fan, you may want this mag. See and read the early issues of MAD MAGAZINE, its a real blast. Book is complete, the humor intact, staples too. A real class addition to your MAD collection. SEE SCAN. This book has stood the test of time, lasting nearly 45 years, now can be part of your collection. LOW MINIMUM!! NO RESERVE!! Buyer to pay $4.00 for Priority mail & delivery verification. Insurance optional, add $2.00. Ship to U.S. ONLY! Money orders preferred, checks must clear. Thank you and good luck bidding...PLEASE SEE MY OTHER AUCTIONS... WE NEED HUMOR IN TODAYS WORLD........... Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
