INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046215798, 1806, 'X-MEN 48 VF/NM;GUIDE 80.00', 19.99, 19.99, null, 0, 'Champlain NY', 44.965887, -73.43636, 'USA', '2001-12-09 13:55:09', '2001-12-16 13:55:09', 'A sparkling copy with the purple color uniform throughout.Only some spine stress lines keep this from nm/m. This group of X men are mostly warehouse copies.Also note that this scan generally will overstate defects (Read what the buyer of a $1000.00 AF 15 recently said about our scan-nov 28 2001 feedback, or just to confirm read the Dec 3 2001 feedback of a VF Green Lantern purchase OR read what a buyer of a nm Thor said"Pinpoint grading (an ebay rarity!) Recommend this seller.Dec 3 2001)).All grades are guarenteed within 0.5 of any grading service. The grade quoted above is an accurate grade reflecting the true condition of the book.(Any defect not revealed by the large scan will be discussed apart).The price is set so that you will be hard pressed to find as good a deal anywhere else.(This 33% bigger scan( than the books'' actual size) magnifies and enlarges defects-it is like looking at the book through a magnification factor). Generally speaking the book possess''s a solid intact spine with no splits;staples solidly in place;corners sharp;gloss and color deapth vivid,deep and close to new in appearance;only minor spine stress marks may exist(similar to thoses produced at original printing);overall a glossy off white to WHITE paged copy offered at an unbeatable initial bid ,with a LOW RESERVE(This low reserve allows our customers to use the buy it now feature.Many have missed out on previous books,and this feature usually prolongs the auction a bit longer to give everyone a chance to bid).As we have a large multiple grade inventory of Silver and Golden age books,many will be offered for sale in coming ads.There are many comics being auctioned off on Ebay this week.Combine auctions to save postage.THOUSANDS of other books are still to come including most Marvel and DC titles from 1960 -1972.Use the BUY IT NOW feature to end the auction and lock out the competition. We are multiple CBG award winners;EBAY Power sellers;and have 1000 total positive feedbacks(many multiple) since we began here about 2 years ago.Some may remember us for our full page Marvel adds starting in the 1980''s.Our Marvel inventory is extensive and stocked in multiple conditions..Note.All our scans are "High resolution".That means a magnified, extremley detailed scan which is about 33% LARGER than the actual size of the comic.( so, of course, defects appear about 1/3rd bigger,than if you were viewing the item right in front of you)..Why do we do this?Why do we want the comic to have all the defects OVERSTATED? Here are the reasons; 1)All defects are CLEARLY seen.(in our opinion a small scan is of no use-the grade can be anything). 2) By revealing all defects,you can grade based upon what you like or dislike about a book. 3) No two grades have the same defects,thus a large scan allows you to delineate the key aspects of the book. 4)A large scan will OVERSTATE defects.Defects appear LARGER than what you will see when you get the book.(This applies especially to creases(thicker than actual),and stress marks,and to a lesser extent to color tones,which may show gradations in color not visible with the naked eye).Most of our customers note that the book is nicer when it arrives than what this scan revealed(reasons;the scans bright flood light reveal evey single microscopic impact point,plus defects appear 33% larger.) 5)All our books are guaranteed to be in the same general grade range(within+/- 0.5) if the book is slabbed(within 14 days of purchase) 6) Full exchange privledges on any item purchased.within 7 days. 7) Shipping : Cost; 5.00 for less than 5 comics(priority mail with delivery confirmation) in North America NOTE ;Allow