INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046282708, 1626, 'Lovely Victorian Style Condiment Set', 39.99, 39.99, null, 0, 'Florida', 30.621671, -81.617754, 'USA', '2001-12-09 15:50:02', '2001-12-16 15:50:02', '.titledata { font-family: verdana, sans-serif; font-size:18px; color:#FC1230; } .description { font-family: verdana, sans-serif; color:#000000; } .link { font-family: verdana, sans-serif; font-size:12px; underline; } HR { color: #000000; } Lovely Victorian Style Condiment Set Click image to view larger version Click image to view larger version Click image to view larger version Click image to view larger version Click image to view larger version Click image to view larger version Up for your viewing pleasure and discernment is this lovely multi pieced Victorian styled vintage condiment set. The glass shakers, cruet, and mustard jar are all of lovely crystal panelled glass with silverplated tops and rack. No markings that I could find. No chips or cracks to any of the glass. The two spoons that came with this set are both marked EPNS, and are plain, no pattern. Exact vintage of this set is unknown to me. One of the shakers is missing the silver ring that the shaker top slides down over, but that should be able to be replaced fairly easily. The cruet has a beautiful cut, faceted, and ground stopper, absolutely gorgeous! This great condiment set would make an outstanding Christmas gift for your special someone, or would make a nice addition to your own Victorian collection! Buyer to pay $7.55 Priority Mail shipping/ins. There may be a small handling fee added provided an item requires special handling or care in packaging. I will combine multiple items to save on shipping! I will ship internationally, however the bidder MUST have a good command of English language, and there will be a $5.00 international surcharge on any items under $50, no exceptions. Canadian bidders: Please realize that your bid is international and expect to pay postage accordingly. Payment MUST be postmarked within 5 days of close of auction. Checks take 7 days to clear, M.O. ships within a day or two of receipt, and we accept major credit cards through Billpoint and Paypal. Please e-mail with questions before bidding, as all sales are considered final, and we check mail regularly. Good luck, happy bidding, and thanks for looking!_ Payment I accept the following forms of payment: PayPal, Billpoint, Money Order, Personal Check, Billpoint. Low cost image hosting and full service auction management solutions: AuctionWatch Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Please wait for the end of auction e-mail with further instructions, as your item may require a special handling fee.');
