tely 2 weeks. (Australian Residents Only. There is a 10% GST on all purchases. Any complaints please forward to John Howard.) Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046297796, 1945, 'SIGNED Christopher Radko Christmas ORNAMENT', 20, 20, null, 1, 'San Francisco, CA', 37.784827, -122.727802, 'USA', '2001-12-09 16:15:51', '2001-12-19 16:15:51', 'The newspaper advertisement shows the ad for christopher radko''s appearance in walnut creek, Ca where I waited for hours to have Mr. Radko personally sign this ornament. I believe that now he no longer tours the country for these promotions as he did then. I can confirm that this is authentic, that I personally purchased this and that he signed it . There is also a card which will accompany the ornament which states that this is personally signed by christopher radko and also the small card which states that "this decoration is individually mouthblown, silvered, and handpainted, enhancing their collectability and making them a perfect holiday/hostess gift" This is a beautiful, signed ornament by christopher radko. Signed 1993. It measures 5 1/2" high, about 4" across the mid-section and 2" at the bottom of his feet. He is precious and reminds me of the pillsbury doughboy snowman with a red hat. This would be lovely on an all white decorated christmas tree. He is wearing a glittered scarf around his neck and has glitter cuffs at his ankles and wrists. This is like-new. . I will wrap well and double box this item. Buyer will please purchase insurance. Shipping will be $6.00 and insurance at cost. Billpoint, paypal and money orders only. Happy Holidays!!!!! Thank you for shopping at Ebay. Click on a picture to enlarge '') //-- '') //-- '') //-- Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Payment due within 10 days');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046298300, 1947, 'The Green Lantern, DC comics, ''72-''74', 6.99, 6.99, null, 0, 'JERSEY SHORE....', 40.73235, -74.075391, 'USA', '2001-12-09 16:16:48', '2001-12-16 16:16:48', '8 Issues of THE GREEN LANTERN All originally 20 cents. Except where noted, all comics in very good condition. COMICS: V.23, No. 218, Oct-Nov ''72.."The FLASH of 1,000 FACES!" V.23, No. 219, Dec-Jan ''72-''73.."The MILLION DOLLAR DEATHTRAP!" V.24, No. 222, July-Aug, ''73.."C''mon Readers! I need your help! My Power Ring needs the will power of everyone out there to stop FLASH from killing us all!" (some minor ink writing on exterior rear cover) V.24, No. 224, Nov-Dec, ''73.."You''ll never guess what happens when the FASTEST MAN alive is Haunted by the FASTEST MAN DEAD!" V.25, No. 225, Jan-Feb, ''74..A full-length spectacular! "Green Lantern--MASTER CRIMINAL OF THE 25TH CENTURY!" V.25, No. 226, March-April, ''74.."I can''t decide am I a HERO or a VILLIAN? Am I THE FLASH or CAPTAIN COLD?" (lower front corner has small bend/tear) V.25, No. 227, May-June, ''74.."It isn''t possible! I can''t die this way!..Reader, can you face the terrible secret of this book?" V.25, No. 230, Nov-Dec,''74.."FURY OF THE FIRE DEMON! featuring the return of the AMAZING DR. ALCHEMY!" Winning bidder pays $4 s/h. We package carefully, however we cannot guarantee items lost or damaged during shipping and we suggest insurance at an additional cost of $1.10. Please, let us know if you want insurance. We accept money orders, personal checks(7 day clearance), Paypal. Payment due within 10 days of end of auction. Items are shipped on the Saturday following cleared payment. Though we dislike this.....Negative feedback, along with notification to Ebay regarding winning bidder who doesn''t complete the transaction. Please, email us with any questions! CHECK OUT OUR OTHER AUCTIONS! If possible we will combine s/h for multiple winning bidder. Thanks so much for bidding on our auction & GOOD LUCK!');
