INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046320802, 1985, 'NAPCO SilvLb Mrs Claus-Spaghetti Salt Shaker', 4.99, 4.99, null, 0, 'MD', 38.250996, -76.73974, 'USA', '2001-12-09 16:47:50', '2001-12-16 16:47:50', 'This is a very old Mrs. Santa Claus shaker. I guess poor Santa was broken. She has spaghetti trim. You_ll have to look at the picture to determine how much original paint is missing; I have never seen a picture of her. She has a silver Napco label and is numbered 5920. She has a cork too, but I haven_t tried to remove it, it looks pretty embedded. I don_t see any chips or cracks, but I see dust between the spaghetti fringes. Here is the story, if you are interested. My great grandmother passed away in 1982 at the age of 93. My grandmother is now 93, and she says it_s just too much for her to continue to decorate for Christmas. My mother, has sorted through all of the ornaments and goodies, has kept way too many, and gave me the rest to sell on eBay. You may want to glance at some of my other auctions. Thanks so much for stopping by! SHIPPING COSTS: $3.50 PRIORITY Or $2.00 wrapped well in bubble wrap in a First Class Envelope Click here to ask questions before the auction ends! Push here to see what other goodies I have on eBay! I ACCEPT PAYPAL! Y o o W h o o ! STOP! Before you bid, please take a minute to read my terms. Thanks! PAYMENT: Payment must received within 10 days Cash Paypal Money Order or Cashiers Check Personal Check (May delay shipment) SHIPPING: Items shipped USPS are sent within 24 hours after payment is received. I only ship FedEx items once a week, and the day varies. (Drop-off is an hour away) Insurance is added upon request and payment I will only ship in the UNITED STATES!! Hawaii and Alaska will pay actual shipping unless it is shipped USPS Priority GUARANTEE: I guarantee all items to match the auction description My auctions are represented to the best of my knowledge I do not claim to be an expert on the items that I sell I will gladly inspect an item for any marks or specifics that may help you determine the origin, age, or value, PRIOR to the end of auction. All sales are final. Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046320820, 1986, 'S-Antique Rugs Persian Qashkai Rug (9x7)', 167.5, 1, null, 3, 'Where you get gorgeous rugs at lowest prices', null, null, 'USA', '2001-12-09 16:47:05', '2001-12-16 16:47:05', 'S-Antique Rugs Persian Qashkai Rug (9x7) This rug measures 8ft 10 inches x 6ft 7 inches.The rug is semi antique (30 years old) .The rug has some white spots .As this is handmade semi antique rug it may not be in 100% perfect condition.The theme of the Shiraz rugs seem more sophisticated than primitive. Sheraz rugs are never too overwhelming in their designs or color schemes. Along with geometric motifs, small animals or plants are often seen in parts of these rugs.These rugs of these southern Sheraz of Iran are hand-woven usually with symmetrical Turkish knots up-to a density of 100 knots per sq. in. The wrap and weft structure is strong, durable cotton or in some cases, goat hair.Don''t loose this oppurtunity to own this rug at fraction of it''s original cost. NO RESERVE Preferable payment method is through papal,Visa,Master Card.Personal checks and Money Orders and COD also accepted. Buyer to pay $30 for shipping and handling. Insurance of $5 should also be included if desired. Please click here to see my other auctions. Combine shipping will save you alot of money. Created by eBay Seller''s Assistant Pro Click on a picture to enlarge '') //-- '') //-- '') //-- '') //-- '') //-- Free Honesty Counters powered by Andale! Payment Details U.S. Shipping and Handling $30.00 Shipping Insurance per item (optional) $5.00 Sales Tax (6.500% if shipped to FL) _ Learn more about checkout Payment Instructions Buyers will receive an email after the sale for checkout instructions.');
