ve on S/H. Questions? E-mail us at: etcshop@ptd.net or phone us at (570) 331-0914 www.etcshop.com Payment and Shipping Info Payment Options Credit Card, Money Order / Cashier''s Check, PayPal, Personal Check Shipping/Handling Rate $5.95 Insurance Rate $1.10 Shipping Options US Postal Service Sales Tax 6% for in-state buyers / 0% for out-of-state buyers Terms I accept PayPal! Click here to learn more.');
