INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046354375, 2070, '6 LUSCIOUS VINTAGE PANELS w/ROSES!!!', 52.63, 9.95, null, 9, 'A Victorian in Old Town Napa', null, null, 'USA', '2001-12-09 17:23:22', '2001-12-16 17:23:22', 'Just in time for the Holidays!!! Here are SIX beautiful vintage drapes (3 PAIR) made with the most gorgeous floral fabric! There are MANY lovely colors to the various flowers (roses, rosebuds, tulips,...) on a very pretty darker cream background. I believe these date to the 1940''s and are in very nice condition! EACH panel measures approx. 80" long (with a nice 3" weighted hem), 26" wide at the pinch pleated top, and 44" at the bottom. Just some small areas of slight wear on the edges of a few of them, and they are no longer lined. The fabric is heavier in weight, with a nice nubby texture (similiar to barkcloth). These have recently been dry cleaned and are READY TO HANG to add vintage CHARM and sophistication to your home! If you don''t need all 6 panels, you could recover a side chair, recover your dining room chairs or make matching pillows. You will LOVE these!');
