INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046357758, 2094, 'X-MEN (1991) #1-16 Annual #1 (1992) NM+', 19.99, 19.99, null, 0, 'Des Moines, IA', 41.672687, -93.572173, 'USA', '2001-12-09 17:25:42', '2001-12-16 17:25:42', 'X-MEN (1991) #1-16 Annual #1 (1992) NM+ Near Mint plus issues of the 1991 X-Men series that is now 10 years old but still affordable. Lot comes with all 5 covers of #1, including the Prestige Format #1e. Numbers 2 through 6, 8-9, 11-16 and Annual 1 are also included, but #7 and #10 are missing. Im selling off my private collection from the 1970s-1990s. The books have been preserved in bags with boards and in acid free longboxes for up to 20 years. Unless specified above, all comics are NM-/NM with no major creases or tears. Some have light stress on the spine. See scanned image for a representative sample. Many of these books deserve CGC consideration for those who have the time and money. Shipping is $5.00 and $1.00 more for optional insurance. I strongly suggest investing in insurance since books are shipped at buyer?s risk. This is the safest and quickest way to get your books. Alaska, Hawaii, and Canada add $1. Shipping is extra for large lots (over 10 books) and International destinations. For lots of over 30 comic books the buyer can have books shipped by Media Mail (Book Rate). Win my other auctions and combine shipping costs. All comics are bagged, most with backing boards, and are sent in sturdy boxes or Priority Mail envelope. Check my Feedback for evidence of secure shipping and bid with confidence. Payment is due within 10 days after the close of the auction. I accept the following methods of payment. 1) Money Orders, Cashiers Checks, Billpoint On-line Payment, and PayPal allow for quickest turnaround. Comics are shipped out within 24 hours of payment arrival. 2) Personal Checks (I will hold books for 5-7 days until check clears). 3) International orders use Billpoint or PayPal please. Thanks for visiting the site. Email your questions to me. I want your business as well as positive feedback.');
