INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046371017, 2110, '2 head Eagle or Distelfink Iron Trivet Amish', 2, 2, 6.33, 0, 'Pocono Mountains', 41.118226, -75.39631, 'USA', '2001-12-09 17:42:09', '2001-12-16 17:42:09', 'PLEASE READ ** THE "FINE" PRINT ** BEFORE BIDDING! 2-headed Turtledove & Heart PA Dutch / Amish Style Cast Iron Trivet My latest listings consist of several cast iron trivets that I bought from a local collector to help her lighten the load of her extensive collection as she prepared to move south. I do not collect trivets, so any information I include here is only what was passed to me, as I can not claim any personal expertise in the area. This cast iron trivet is a nice match to another one of my listings with a single turtledove. This trivet has a heart handle with an iron stand shaped plate. The main body has a two headed turtle dove with a heart shaped body, flanked by two more hearts. It has been painted with PA Dutch / Amish styled accent colors of blue, green, red and yellow. Measures 8 1/4" x 4". Rear markings: "260". Revision... I was calling this bird a turtledove until I received an email from a friendly eBayer (thanks lenka!) informing me that this is not a turtledove, but rather the "Mystical Distelfink with two heads so he is better able to watch more closely for evil to ward off and keep away from the distelfinks care giver. The farmer would also paint this bird on his barns to keep it and it''s contents safe." That info got me curious and on the web site www.amishmarket.com, I found this description of a hex sign with a similar design: "Double Eagle (Courage) A large, stylized double headed bird, a double headed eagle, is shown in this design. The eagle represents strength and courage. The trinity tulips add faith, hope and charity; the heart add love. This design symbolizes strength and courage." This trivet doesn''t have the trinity tulip, but it does have the hearts, and the bird looks like the double headed eagle shown on the hex sign. So, it looks like it''s not a turtledove afterall, but either an Eagle or a Distelfink (goldfinch)! Please click here to preview our complete gallery of listings! ** THE "FINE" PRINT ** PLEASE don''t bid if you are unable to follow seller guidelines. Thank you! PAYMENT METHODS: Now we''re all electronic for secure, ecological transactions (no paper waste, no driving to the PO!) Payments are expected within 5 days of auction end. We accept: eBay Payments (Billpoint) MC/VISA eBay Payments secure E-Checks from your checking account (no more money order fees!) -- note: e-checks take 3-4 business days to clear before shipment (per Billpoint) NEW... also accepting PAYPAL! Sorry, NO CHECKS & NO BIDPAY Use Checkout (above) for "eBay Payments" OR click the logo (below) for "Paypal" payments SHIPPING: Buyer pays 4.50 S&H for Priority Mail (USA shipments only) -- in my 2 1/2 year eBay experience, the fastest, most cost effective & reliable shipping method Shipping includes Delivery Confirmation for package tracking Insurance additional, so please specify if desired ($1.10 covers up to $50). International shipping available for additional cost PLEASE see my "About Me" page and check out my other auctions (combined auctions can save $ on shipping)! Give a WONDERFUL DAY and Happy Bidding! Free Honesty Counters powered by Andale! Payment Details U.S. Shipping and Handling $4.50 Shipping Insurance per item (optional) $1.10 Sales Tax (0.000% if shipped to none) _ Learn more about checkout Payment Instructions $1.10 insurance covers up to $50');
