INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046388825, 2143, '18 Genii Magic Mags - No Reserve!', 14.95, 14.95, null, 1, 'North Cental IL - The Magic Surfshop', null, null, 'USA', '2001-12-09 18:01:08', '2001-12-16 18:01:08', 'h1 {font: 26 Arial; font-weight: Bold; text-align: center} h2 {font: 20 Arial; font-weight: Bold; text-align: center} h3 {font: 16 Arial; font-weight: Bold; text-align: center} h4 {font: 10 Arial; font-weight: Regular; text-align: center} p.jus {font: 14 Arial; text-align: justify; width="95%"} p.cen {font: 14 Arial; text-align: center; width="95%"} 18 Genii Magic Mags - No Reserve! Miscellaneous issues from 1993 thru 1997 Click Images to Enlarge Description: This week I''m cleaning out all of my duplicate magic magazines. I''ve tried to list them in closely related volumes or years. All 18 magazines in this lot are in VG condition. There''s a few corners turned up here and there but nothing major. I''m sure you''ll be pleased. Here''s what''s included: V57:01 Patrick Culliton & T.L. Williams V57:02 Vik And Fabrini V57:03 Punx V58:04 (mis# V58:03) Mike Maxwell V58:05 (mis# V58:03) Tom Mullica V59:02 Geri Larsen V59:04 Luis DeMatos V59:05 Larry Jennings V59:06 The Champions Of Magic V59:07 Yuka V59:11 Treasures From 60 Years V59:12 Alex Elmsley V60:01 Why Joel Hodgson Loves Magic V60:02 Paul Harris V60:03 Lisa Menna V60:05 Stephen Minch V60:06 FISM - A History V60:09 David Regal And His Interesting Friends Shipping Charges: This package weighs nearly 9 lbs - that''s heavy! Buyer to pay $13.00 for Priority Mail (2-3 day delivery) or $6.50 for Media rate (upto 14 day delivery) - buyers choice. Insurance is optional but recommended. If desired, insurance can be purchased at additional actual cost to buyer based on winning price. Uninsured packages are mailed at buyers risk. And of course, I''ll always try to combine multiple auction wins in order to save on shipping costs. Please note that I only ship within the United States and Illinois buyers must add 6.25% sales tax. Payment Options: Paypal and Billpoint are my preferred methods of payment. However, I also gladly accept money orders, cashiers checks and personal checks. If using Paypal please send payment to my eBay username (rbsurfshop@home.com). Please don''t be a deadbeat bidder. I''m sure your mother raised you better than that. Terms And Business Practices: Call me old fashioned but I still prefer to do business via friendly and personalized email. You will not go through checkout lanes, lines or websites in order to do business with me. I don''t like getting generic "send me the money" emails so I won''t do that to you. It''s all a bit too impersonal for me and I strive to maintain a very high quality of service. I think my feedback proves that. Feel free to contact me or I will contact you within 24 hours of auction end. Please ask questions ahead of time, I''m always happy to answer. Payment is expected within 10 days of auction close and timely payment always insures positive feedback when payment is received. Special Note: All @home mail accounts nationwide are experiencing problems due to Excite@Home''s bankruptcy. If you cannot reach me via my eBay username account, please use my alternate account rbsurfshop@hotmail.com . You may also want to check out the other great auctions that I am currently offering. They all start very low and there''s never a reserve. Thanks for looking! Copyright _ 2001, Roscoe''s Magic Surfshop & Novelties Wishing you the best Magic that life can bring! Email: rbsurfshop@home.com');
