ected within 10 business days of auction close. Because my _day job_ is in retail and my hours constantly change, I ship weekly on a variety of days. Since 9-11-01, shipping seems to be taking longer. Please allow time for your items to arrive. When you opt for first class, I reserve the right to ship media mail when appropriate if the shipping is higher than stated in the auction. Serious bidders only! I leave feedback for all transactions. I love to leave positive feedback! However, if payment is not received within 10 business days, a Non-Paying Bidder Warning & Final Value Credit will be filed with eBay. If you cannot agree to the terms of this auction, please do not bid. If you have a negative feedback rating (more negatives than positives), please do not bid as it will be cancelled. If you have "Private" Feedback, please email me BEFORE bidding. In the rare event that eBay experiences an "outage", I reserve the right to "relist" NON-Reserve auctions if they close during the outage . I will offer a full refund on any item with a major defect not mentioned in the ad, however, I do not refund for _buyer_s remorse_ so please be sure that you are able to live with the purchase AS IS before placing your bid. Thanks for your interest in my auction! FREE bulk listing tools, image hosting, counters, auction management solutions, AuctionWatch.com Payment I accept the following forms of payment: Billpoint, Money Order, Bidpay. Shipping & Handling $3.00 USPS First Class $4.00 USPS Priority $5.50 Priority Insured Low cost image hosting and full service auction management solutions: AuctionWatch');
