INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046402813, 1956, 'CASED STEAK KNIFE SET OF 6, BAKELITE? HANDLES', 7.99, 7.99, 42.4, 0, 'Pacific Northwest', null, null, 'USA', '2001-12-09 18:14:17', '2001-12-16 18:14:17', 'This is a beautiful set of steak knives that appear to be unused. The manufacturer is Everbrite, the blades are stainless steel, and the handles are made to look like antique, yellowed ivory. I suspect that the handles may be Bakelite or celluloid, but I don''t know that for sure. The case is a faux leather, with gold embossing on the corners; the interior is red velvet with a lid of beige satin. Each knife is 8.5" long and each blade is stamped with "Everbrite, Stainless Steel". It appears to be a gift from the 1940s or so that was never used. Very pretty! Bid now! Personal checks, money orders, Mastercard, Visa and Discover Cards are accepted through PayPal, Billpoint and Bidpay. Buyer pays actual shipping and handling. Thanks for looking and enjoy your bidding!');
