ful bidder will prepay (Including S&H & Insurance, if desired) within 10 days of the close of the auction. I DO NOT TAKE PAY PAL or Billpoint, so no check out. I do take Pay Direct , Money orders which receive immediate shipment ALL BIDDER WITH LESS THAN 30 FEEDBACK PLEASE SEND MONEY ORDERS and checks with merchandise held for clearing. Seller not responsible for uninsured items. We ship Tuesday, Wednesday and Thursday. Because of time limitations, I give feedback when you notify me that item received. Most items can be shipped together and save postage. I DO NOT SHIP COOKIE JARS TOGETHER OR OTHER HEAVY ITEMS TOGETHER . Life is full of ups and downs. The trick is to enjoy the ups and have courage during the downs." Visit Fun Market Collectibles today! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions No returns without prior approval.');
