tic oversized rounded collar(can be worn up or down), a single top button & loop closure, classic 3/4 length sleeves, & 2 front slit hip pockets...The body styling is so classic 1940s with a freeform front, super wide aline swing span measuring an approx 40" from seam to seam, & the inside is magnificently lined with a golden yellow satin/acetate(see pic #5)...There is no label(but i can almost bet 100% this is a CEE-DEE original because i have sold many before & all signs point to it''s signature design & quality!) and there is no size stamp either, but will fit up to a modern day size "XL or even PLUS" very nicely up to these following approx measurements*** ~~~APPROX. MEASUREMENTS~~~ BUST~up to 42" snug 44" WAIST~up to 50" HIPS~up to 56" SHOULDERS~17 1/2" across SLEEVES~18 1/2" LENGTH~40" A-LINE SPAN~40" from seam to seam ~~~CONDITION~~~ ***Now the best detail saved for last being this FABULOUS FORTIES swing coat is in absolute wonderful vintage condition with no visible boo boos to report!!!***CAN''T YOU JUST SEE SHOWING THIS BABY OFF ON NEW YEAR''S EVE WITH YOUR PRETTIEST BLACK PARTY DRESS?!***SO G@@D LUCK, HAPPY BIDDING, & PLEASE VISIT "MOTHER" AGAIN S@@N!***THANX*** ***MOTHER''S "new, vintage & gothic g@@dies" make such PURR-FECTLY UNIQUE gifts to give for the holidays!*** ***ATTENTION!***Please click the gallery link above to visit my "NEWLY REMODELED & EXPANDED" picture pantry of all my yummy ebay "NEW & VINTAGE G@@DIES!"*** ~~~AUCTION TERMS & PAYMENT OPTIONS~~~ #1~SERIOUS BIDDERS ONLY PLEASE! #2~WINNING BIDDER must email me 3 days after closed auction and i must receive payment no later than 10 days after confirmation(or sale will be null & void!) #3~ACCEPTABLE FORMS OF PAYMENT~MC/VISA through PAY PAL online service or MONEY ORDERS ONLY(no personal checks please!!!) #4~SHIPPING TERMS-clothing is shipped USPS PRIORITY unless item is very heavy it will be sent USPS PARCEL POST!...NOW, due to the new rate increases, I NO longer require INSURANCE unless desire