7 grams; chocolate spoons, 21 grams; tablespoons, 61 grams; large serving spoons, 82 grams; ladles, 23 grams; cold meat fork, 48 grams; jelly, 26 grams; sugar spoon, 30 grams. This fantastic set is monogrammed as shown. All pieces are in perfect condition with the exception of the carving set pieces, which have some slight bending to the collar pieces or "rests" at the mid-point, but this is of course an extremely minimal consideration at most - all other pieces are in PERFECT condition. Additional Photograph 1 Additional Photograph 2 Additional Photograph 3 Additional Photograph 4 Additional Photograph 5 Additional Photograph 6 Additional Photograph 7 Additional Photograph 8 Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
