INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046448487, 2297, 'JAMAICA -- MYERS'' INN & LIQUOR STORE', 7.95, 7.95, 15.96, 0, 'Richmond, VA', 37.561962, -77.425452, 'USA', '2001-12-09 18:58:27', '2001-12-16 18:58:27', 'This postcard, probably from the 30s or 40s, pictures an interior view of "The House of Myers.''" A description of the scene, on the back of the card, reads, "A warm welcome awaits you at MYERS''S PLANTERS'' PUNCH INN and LIQUOR STORE, Down at ''The Sugar Wharf'' in Jamaica -- Headquarters for Rums, Imported Wines, and Spirits. The House of Myers'', founded 1879, are the largest individual holders of finest and oldest Jamaica Rums in the World." The card is in EX condition and postally unused._ Buy with confidence from QRS. Our name stands for "Quick, Reliable, Service". Over 24 years collectibles experience. Visit our e-Bay pages (ernieatqrstuv) every week for new listings of rare and significant postcards, sports collectibles, and other nostalgic collectibles. Buyer pays postage. The postage and handling rate for postcards, gum and tobacco cards: 1-3 cards $1.00. We try to estimate exact postage for other lots. We require the purchaser to cover exact insurance cost for purchases over $75.00. Virginia residents must pay 4.5% state sales tax.');
