INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046450451, 1130, 'Retro Nut Chopper on Glass Measuring Cup', 9.5, 9.5, null, 1, 'Mid Michigan', 42.544084, -83.21527, 'USA', '2001-12-09 19:01:06', '2001-12-14 19:01:06', 'Just in time for holiday baking, I am offering this vintage nut chopper that is probably from the 50s (I remember my mother using one very similar to this). It is in excellent condition...the spring that keeps the chopper mechanism moving up and down is in sturdy condition and the blades are sharp. There is a wooden disc in the bottom which prevents the chopping blades from hitting against the glass of the one-cup measuring cup. It has a black wooden knob on the top that is flattened in shape for comfort while chopping many portions of nuts for holiday baking. The tin lid has a retro design of black and red on ivory color. It is in excellent used condition. Shipping within US is $4.50 for Priority Mail. Outside US is usually higher so please inquire before sending payment. Money Order/Check/Credit Card through eBay Payments (Billpoint) or PayPal. Thanks for looking and please click on my other auctions.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046451530, 2303, 'Retired Radko Disco Saturday Night Santa', 42, 42, null, 0, 'Royal Oak', 42.518635, -83.16357, 'USA', '2001-12-09 19:01:15', '2001-12-16 19:01:15', '.titledata { font-family: verdana, sans-serif; font-size:18px; color:#FC1230; } .description { font-family: verdana, sans-serif; color:#000000; } .link { font-family: verdana, sans-serif; font-size:12px; underline; } HR { color: #000000; } Retired Radko Disco Saturday Night Santa This is a RETIRED hand made ornament created by Christopher Radko. This ornament was crafted in Poland. The ornament is Santa in a white leisure suite. Doing a little disco dancing like in the 70''s classic movie Saturday Night Fever. That stared John Travolta . The name is SATURDAY NIGHT SANTA. The ornament measures 7" and is in Mint Condition with the Radko tag and box. The box and tag are not shown but are included. We will pack well and ship by UPS. All UPS is insured and can be tracked on line. We will wrap well ans ship by UPS . All UPS is insured and can be tracked on line. Shipping is $5.75 BUYER INFORMATION Payment I accept the following forms of payment: PayPal, Billpoint, Visa/Master Card, American Express, Discover, Money Order, Personal Check. Low cost image hosting and full service auction management solutions: AuctionWatch');
