Negative feedback will be left for failure to respond to my emails and for non-payment. - If I feel uncomfortable about your bid, I will cancel it at my choosing. - Credit card payments are ONLY accepted via Paypal.com or BidPay.com. I do not accept credit cards directly. - If you plan to pay with Paypal, please make note that we ONLY ship to CONFIRMED ADDRESSES for both your protection and ours. - Feel free to email me any questions you may have. Do not wait until near the end of the auction to ask questions, for I may not be around to respond to them before the auction ends. Click here to see my other auctions... Hourly Statistics by Ruby Lane Complete Auction Management for Auction Buyers and Sellers AuctionTamer Payment Details U.S. Shipping and Handling $0.00 Shipping Insurance per item - Sales Tax (none) Payment Instructions I DO NOT USE THE Ebay CHECKOUT SERVICE. I WILL EMAIL THE WINNER PAYMENT DETAILS SHORTLY AFTER THE AUCTION ENDS.');
