n shipping at buyer''s expense. Always ask questions before bidding unless you are sure. ______N.Z. BIDDERS! PLEASE REMEMBER GST!!____ Payment I accept the following forms of payment: Money Order, PayPal, BidPay, m/o''s, cashier''s checks.. Low cost image hosting and full service auction management solutions: AuctionWatch');
