INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046460515, 2014, 'The Latest Thing Mannequin * Suitably Soph...', 9.95, 9.95, null, 0, 'Portland, OR', 45.580557, -122.374776, 'USA', '2001-12-09 19:08:59', '2001-12-16 19:08:59', 'NEW Mint in Box Suitably Sophisticated - Collectible Resin Mannequin (1954) In 1954 the ''H'' line was introduced. Known as the ''flat line'', the shoulders, hips, and busts were gone and no longer was there any attempt to attract the male glance. Loose-fitting and fluid, the perfect tailoring of this suit referred back to the boyish look of the 20''s. Size: 6" USA S&H - $4.00 Only $1.00 for each additional item. Canadian S&H - $6.00. Only $1.00 for each additional item. International S&H - $8.00. Only $1.00 for each additional item.. To Speed Up Your Shipment Accepted by atEyeLevel Also Money Orders or Checks! Winning bidder, click here to pay instantly with PayPal! Visit Our About ME page for more information. atEyeLevel Thanks for Bidding...!!! Be Sure to See Our Other Auction Items This item has been seen by people! eBay''s most successful sellers use Auctionworks sales management services! Visit atEyeLevel today! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Please read the auction terms regarding the use of eBay Checkout');
