INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046466299, 2341, 'OLD BAKER''S COCONUT LAMB CAKE MOLD 1921 NR!', 31, 5, null, 20, 'Maryland''s Eastern Shore', 38.564649, -76.69229, 'USA', '2001-12-09 19:15:01', '2001-12-16 19:15:01', 'Here''s a really nice old Baker''s Coconut Lamb cake mold from 1921 that we purchased at an antiques auction over the weekend. This old mold is in remarkable condition considering it''s age. It doesn''t look like it was ever used. On the inside of the mold, there was an old recipe card for "Coconut Lamb Cake". The interesting thing is that most of the brands the recipe calls for are either no longer being made or are very old famous well used brands. For instance, "Swans Down Cake Flour, Snow Frosting, and Calumet Baking Powder." The recipe card is dated 1921. The lamb mold measures 13 and 1/2" in length by 8" in height. This old mold looks as if it was a promotional item for The General Foods Corporation in the 1920''s promoting Bakers Coconut. The mold also has "Baker''s Coconut" embossed at the bottom beneath the Lamb. This is a great old piece of advertising, not to mention a wonderful collectible for the culinary person! This old Lamb mold would also just be a fabulous piece to display in a country kitchen. You also have the original old recipe card that came with the mold, so there''s no excuse not to put this old mold to use!! Best of all NO RESERVE . Personal checks or money orders accepted. Checks must clear before shipping. We can accept Visa and MasterCard, but only via PayPal. All items sold as is, so please be sure to ask any questions before you bid. Thanks for viewing our auction and be sure to view our other auctions via the link below. Click here for our other auctions.');
