INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046467007, 2364, '* Incredible HULK #4 Lee/Kirby! G/G+ 1962', 9.95, 9.95, null, 1, 'Please see my other auctions. LA', null, null, 'USA', '2001-12-09 19:15:38', '2001-12-16 19:15:38', 'Incredible Hulk #4! Hey there! Welcome to my auctions for this week! Yup...it''s the original. Hulk #4, a Stan Lee and Jack Kirby classic! This is a Good/Good+ copy. It''s got lots of wear, but is still a solid copy. Both staples are still well attached, as is the centerfold. The book has a slight spine roll. The best part about this book is that the pages are supple and a GORGEOUS and SOLID off-white, as are the inside front covers! There is NO sign of color unevenness at all! Nice! This is part of a large collection I bought a while back from Showcase-New-England, and this is what they graded it, I agree, so you can be doubly sure of grading! Overstreet Guide for this book is $140.00 H A P P Y H O L I D A Y S ! The Holidays are upon us! This is an EXCELLENT gift for the comic collector you know and love, or even yourself ! ALL items PAID FOR by December 17th are GUARANTEED to ship in time for Christmas if shipped Priority! Cool, huh? GRADING: I''ve been collecting and selling for over 11 years...I care about comics, and condition, and I grade according to Overstreet and CGC standards. I grade strictly because I know what it''s like to spend good money on a book that I REALLY wanted, only to be really disappointed when it shows up two grades lower than advertised. So, please bid with confidence! SHIPPING: Shipping will be $4.50 (isn''t that crazy?) for USPS Priority Mail, or $2.50 Special Standard (Book Rate). Price includes Delivery Confirmation for both, and insurance can also be purchased. All books are shipped in sturdy packages...no point in selling nice books, and then having them damaged in shipping! And always, shipping is combined for multiple auction wins. International Bidders : I will ship the books anywhere in the world, but it gets SPENDY! I try to ship everything via Global Priority ($9US to most countries), but please note, there may be exchange and bank fees involved. I''m not making extra money, just passing on what I get charged. PAYMENT: Please DO NOT PAY until I have contacted you! This is very important, as it has led to some confusion in the past. Thank you! Hey, check out my other auctions here: Grayson''s Auctions! Enjoy! The Small Print: 1. I answer ALL e-mail questions as soon as I receive them, so please do not hesitate to ask! 2. Winning bidder notifications will be sent out within 24 hours of auction''s end. PLEASE READ the entire note, and pay attention to all details therein. I cannot tell you how many times I''ve received payments with absolutely NO identification as to what it''s for, and then folks get mad when their shipment is delayed! 3. I have had an inordinate amount of non-paying bidders lately. I''m a decent and honest person, but even I get frustrated when people take advantage of me. So please, if you''re not going to pay, for whatever reason, please just don''t bid. If something happens in between the auction''s end, and you sending payment, please do not wait for ME to contact YOU. Communication is the KEY, and usually resolves problems! 4. I can only ship once a week, as I cannot get to the Post Office more than that. Please be patient when expecting your book(s)! 5. If, after you receive your item(s), you''re not happy for ANY reason...please let me know! I have zero negatives because I take care of my customers. We can work out a solution that works for everyone, if it comes to that. My focus is the COLLECTOR looking for specific items, not dealers, or other wholesalers. I want everyone to be not just satisfied, but HAPPY with what they purchase! Happy customers are repeat customers! Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
