ers use Auctionworks sales management services! Payment Details U.S. Shipping and Handling $9.00 Shipping Insurance per item - Sales Tax (8.000% if shipped to CA) _ Learn more about checkout Payment Instructions Please read the auction terms regarding the use of eBay Checkout');
