INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046477850, 2393, '* Charming Tails * Binkey Bunny Snowshoeing', 4.99, 4.99, null, 1, 'One Nation under God', null, null, 'USA', '2001-12-09 19:25:05', '2001-12-16 19:25:05', 'Just come on in! You don''t need to worry about driving around for 20 minutes for a parking space. There are no long lines to stand in. No sore feet and back pain to worry about at the end of the day because your package arrives at your mailbox. Best of all you can decide what you want to pay by placing your bid while baking your Christmas cookies! We have started all our minimum bids on our Charming Tails figurines and Tom Clark Gnomes at low minimum bids so you can have fun bidding! Good Luck! Please feel free to contact me with any questions before bidding and after reading Payment Method Agreement (after photos) at deborahg@one-of-a-kind.com. All sales are final. Personal checks are not accepted and will be returned. *Seller reserves the right to resell item if payment is not received in accordance with payment method agreement.* Awaiting your bid Binkey Bunny Snowshoeing from the Charming Tails series by Dean Griff. Measures 4" x 2 _" x 3" ht. Excellent condition. No niches, chips, or cracks. Nice coloring. No original boxes but a nice white gift box with a silver decorative Christmas sticker has been provided that is included in this auction. Don''t forget to check out the other Charming Tails, Tom Clark and Tim Wolfe gnomes and figurines! Buyer''s Responsibility: Winning bidder please email name and shipping address within 72 hours of auction closing to deborahg@one-of-a-kind.com. to acknowledge winning, otherwise, item will be relisted. Payment Method Agreement: When placing your bid you agree to pay by money order within 10 days of auction closing date or credit card through PayPal. Personal checks will not be accepted. All North Carolina residents will be charged a 6.5% sales tax to be added to the final bid price. Please send money order payments to: Deborah Goeller 102 Chris Court Garner, North Carolina 27529-9625 Visa/Mastercard payments accepted through PayPal only. If needed please use the address: deborahg@one-of-a-kind.com You must be registered with PayPal and have a confirmed address. Please click on the PayPal icon. Shipping: Insured shipping and handling for this item is $4.00 paid by winning bidder. Multiple purchases can be combined if within the same auction week and shipping rate adjusted for shipment savings. All purchases are shipped once payment has been received. You will be notified via email when your item has been sent. No CODs or APO addresses.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046478816, 2395, 'CHRISTOPHER RADKO!!! TAZ SPRITE #4014 OF 5000', 9, 9, 21.09, 0, 'Boating on the Chesapeake', null, null, 'USA', '2001-12-09 19:26:41', '2001-12-19 19:26:41', 'THIS NEW CHRISTOPHER RADKO ORNAMENT, "TAZ SPRITE", HAS NEVER BEEN DISPLAYED AND IS STILL IN THE ORIGINAL PLASTIC. HE MEASURES APPROXIMATELY 9 1/2" TALL. HE IS LISTED AS #4014 OUT OF 5000 LIMITED EDITION. THIS UNIQUE DESIGN COMBINES THE COLLECTABILITY OF WORLD-RENOWNED CHRISTOPHER RADKO CHRISTMAS ORNAMENTS WITH THE IMAGINATIVE FRIVOLITY OF A FAVORITE LOONEY TUNES CHARACTER - THE TASMANIAN DEVIL. THE EUROPEAN ORNAMENT MAKING TRADITION OF YESTERYEAR COMPLEMENTS PERFECTLY THE CLASSIC CARTOON CHARACTER, CREATING AN EXQUISITE HOLIDAY ORNAMENT. THIS DESIGN IS MADE ENTIRELY BY POLISH GLASS BLOWERS AND PAINTERS, AND IS THE PERFECT GIFT GIVING CHOICE FOR ANYONE''S HOLIDAY DECOR. HERE''S TO THE ENCHANTMENT OF CHRISTMAS AND THE GLITTERING MAGIC OF LAUGHTER THAT SURROUNDS WARNER BROTHERS ANIMATED CHARACTERS! I accept PayPal, Billpoint and Money orders. Shipping is $8.00 which includes insurance and a tracking number. For each additional ornament ordered, just add $1.00 per ornament to the total shipping cost. International customers, please contact me for shipping iformation. Payment must be made within 10 days of the auction''s close. BE SURE TO CHECK OUT MY OTHER AUCTIONS AS WELL AS MY STORE! THANK YOU AND HAPPY BIDDING!!!');
