INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046483466, 1482, 'MARY''S MOO MOOS DEERE SANTA BELL LIMITED ED', 5.95, 5.95, null, 0, 'Tammy''s Treasures Wisconsin', null, null, 'USA', '2001-12-09 19:31:02', '2001-12-14 19:31:02', 'MARY''S MOO MOOS DEERE SANTA BELL LIMITED ED Description This is a Mary''s Moo Moos bell called Deere Santa. This is a special limited edition. Enesco and John Deere got together to make this one. These are two top collector names in the collectable figurines. The quality is excellent, and they are highly collectable. This piece is dated 2000. The designer of these adorable cows is Mary Rhyner-Nadig.This piece has a cow dressed up as Santa, and he is sitting on a John Deere tractor. The figurine part sits on top of a cow bell with the date 2000 on it. It stands 4 1/2" high.It will come in the original box. It''s new, and has never displayed. Payment and Shipping The lucky high bidder pays $5.00 for shipping, handling, delivery confirmation, and guaranteed shipping for USA domestic orders. Guaranteed shipping is explained below. Shipping for Canada will be extra, and payments from Canada must be in US funds. Checks are accepted, but will delay shipment of your item(s) for 7 to 10 business days for it to clear. Other payments accepted are, Cashiers check(s), Money order(s) and PayPal. All shipments within the state of Wisconsin are subject to 5% sales tax. Please take a look at my other auctions and storefront items to save on shipping. After the auction PLEASE DO NOT USE eBay''S CHECKOUT (which will appear on this auction page) I will send you an email notification and link to my own checkout page where you will be able to enter all your information and select your payment method. Please DO NOT use eBay''s checkout it does not include all the information you need and will result in you having to do additional work. Please wait for my email. Thank you. PLEASE READ BEFORE BIDDING PAYMENTS Payments are to be made within 10 days of the end of auction. If payment is not recieved within that time, I reserve the right to relist this item. If you win this auction, PLEASE go through my "Click-Out", so you can creat an invoice. This is very important for me and you. I also use it to get your address and payment information. A link to the "Click-Out" will be on the bottom of your winners notification if you are the winner of the auction. Please wait to pay for your auction(s) until all of the items you are bidding on are over so my "Click-Out" can total all of the items you win from me, and adjust the shipping costs. GUARANTEED SHIPPING This means that if you recieve a broken item(s), or your item(s) is lost in the mail, I will replace the item(s) after proof of damage. If I don''t have any more of the item(s) that are damaged or lost, I will refund your money, including shipping costs. SATISFACTION GUARANTEE If you are not satisfied with your item(s), you can return it/them, in the same condition as I sent them, for a refund less the shipping costs. Thanks for looking and Good Luck! Learn More About TAMMY''s TREASURES Click Here To EMAIL ME eBay''s most successful sellers use Auctionworks sales management services! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions Please read the auction terms regarding the use of eBay Checkout');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046484266, 2409, 'VINTAGE MAROON, CHARTREUSE, GRAY PANEL L@@K', 9.99, 9.99, null, 0, 'NE Indiana', null, null, 'USA', '2001-12-09 19:32:09', '2001-12-16 19:32:09', 'New Page 13 This is a neat vintage panel in good condition (no tears, worn spots, or stains), perfect for creating a period look in just the right setting. These colors were "hot" in the late 1940''s through the late 1950''s. I am showing the piece as a runner (which it could certainly be), but it''s actually hemmed top and bottom with a 1-3/4" hem and rod pocket. The sides are finished under also. It measures 16-1/2" wide and 49" long. Here are closer looks at the vibrant colors. The material is definitely cotton. You could also make several pillows from this material. It offers lots of possibilities to a creative person with a vintage penchant! Buyer to pay only actual shipping of $1.26 (5 ozs.) First Class mail in the US. I accept Paypal, personal checks, and money orders.');
