ou pay for the insurance. If you have any questions regarding shipping rates and rules, please ask before sending payment. Illinois residents must pay 6.35% sales tax. Silver Level eBay Power Seller I use BrassPack Packing Supply products to pack my shipments Payment I accept the following forms of payment: Billpoint, Money Order, Personal Check. Low cost image hosting and full service auction management solutions: AuctionWatch');
