INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046488198, 2413, 'Victorian Ruffled Sheer Curtains 96 x 80', 19.99, 19.99, null, 0, 'New Jersey', 40.650802, -74.32351, 'USA', '2001-12-09 19:35:58', '2001-12-16 19:35:58', 'In this auction you will be bidding on 1 Fabulous Pair of Vintage Victorian Styled Priscilla Ruffled Country Curtains, they are made of an easy care probably nylon fabric. You will be getting 2 wonderful panels made with plenty of material. The size of each panel measures 48" wide x 80" long - so this pair of curtains measures 96" wide x 80" long. You will be getting 1 pair this size. These curtains are Very freshly laundered, and there are no stains, or odors. These curtains have a 5 inch ruffle. Ruffle is on one side, bottom, and under the rod pocket. Rod pocket is 2" Very very pretty curtains. A pair of matching tie backs, 24" each, will come with these curtains. These curtains are in very good condition, to near excellent condition, however, they have been used - and are being sold as used curtains, Also listed this week are a matching Very Wide pair of these curtains.All sales are final, so please ask questions prior to the close of the auction. You can definitely imagine a nice breeze blowing thru these curtains. Buyer to pay $7.50 shipping. Visit Art Cookie Collectibles today! Payment Details U.S. Shipping and Handling $7.50 Shipping Insurance per item (optional) $1.10 Sales Tax (none) _ Learn more about checkout Payment Instructions All Sales Final, No Returns');
