INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046490411, 2415, 'Marvel Creative License ELEKTRA RED Statue', 49, 49, null, 0, 'Harriman,NY', 41.299334, -74.14049, 'USA', '2001-12-09 19:37:54', '2001-12-16 19:37:54', 'Marvel Creative License ELEKTRA Statue This is an awesome piece for the Original ELEKTRA statue from Creative License. This is not the Bowen remake, which is out right now. This is a Cold Cast porcelain statue of Elektra in her trademark red outfit. Each one of these statues is individually numbered. This statue is number #1,077 of 2,500. The statue is still in its original box and has never been displayed. She also comes with a pair of her metal sais, as seen in the picture. There is no reserve, so happy bidding. You can find my other items including, WWF and Star Wars figures up for auction by clicking here It would be shipped in bubble wrap to ensure that it arrives to you safely. Winning bidder to pay $8.50 for US shipping and $2.50 for insurance. Personal check or MO accepted. However, personal check must clear first. Payment must be received within 7 days of end of auction. Check my other auctions to save on postage. Talk to you soon QUESTIONS? Email tomasini@frontiernet.net To save on shipping, please check my other auctions Make payments with PayPal - it''s fast, free and secure!');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046491034, 2416, 'Unusual Antique TELL CITY Decorator''s Fabric', 99.99, 9.99, null, 12, 'EARTHJUNK', null, null, 'USA', '2001-12-09 19:40:33', '2001-12-19 19:40:33', 'Tell City Decorator''s Fabric This fabric was hand picked by the decorator at a Tell City Store and 13 yards of it remain. This was purchased in the 70''s to go with the Antique Painted Finishes of Red, Blue, Gold and Green that Tell City featured on many items. It is pictured with the antique green and I could email you a photo of it with a gold Tell City item. Unfortunately, I do not have any red or blue finishes to photo it with. I seasonally change the upholstery on the Tell City upholstered chairs and cushioned rockers for variety. My local upholstery lady has adapted velcro to enable easy change out of the skirts. The cushioned rockers do not need any special adaptions. This 13 yards is enough to probably do at least 2 and maybe 3 Tell City chairs depending on which chairs you have. The fabric is 36 inches wide and is on a cardboard bolt. It has been in a smoke free environment. It appears to be cotton. It is difficult to find authentic fabric for the Young Republic Group in today''s fabric store. The reserve is less than the per yard than the price of new cotton. $6.00 shipping for the 48 states. No handling fee on this easy to package item. Insurance extra at buyer''s discretion. Payment within 10 days. The antique green bread peel is new old store stock from the same Tell City dealer and could be put on buy it now if any Ebayers are interested in it. It has the original tag and is MINT! Happy Holiday Greetings from our Home to Yours!');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046491286, 2429, '1952 Treasure Chest lot of 2 vol 7-9 vol 7-19', 4, 4, null, 1, 'Brainard, Nebraska', 41.177056, -97.00012, 'USA', '2001-12-09 19:38:40', '2001-12-16 19:38:40', '1952 Treasure Chest lot of 2 vol 7-9 vol 7-19 Lot of 2 Treasure Chest Comic Books. Vol.7 no.9, January 3 1952 VG condition. Vol.7 no.19, May 22 1952, Good condition, front upper corner of cover missing. Both are flat and complete with no spine roll, light general wear, good bindings with nice interior page color. Thanks for looking and bidding, Paypal, check or money order. Thanks for looking and bidding NO RESERVE! Buyer to pay shipping/handling and insurance if desired. Please allow time for personal check to clear or send m.o. for quick shipping. Please check out the other auctions we currently have running on eBay. This listing created by eBay Seller''s Assistant Basic.');
