s warrant. Arkansas Sales will need to add 6.125% to the item price. Once I have your address I can calculate it for you. Please read the description. I make every effort to fully disclose all flaws in a short description. Vintage items are sold in the same condition I buy them. Due to nerve damage in my right hand & arm, I cannot wash every item because I loose control. We pack every item VERY carefully, but occasionally breakage happens anyway, and the buyer is responsible for filing and collecting the insurance claim per the rules of the Postal Service. Sellers put a lot of time and money into having these auctions available for your consideration. Please be kind, only bid if you intend to follow through. As with many sellers, this is my only source of income and I depend on you honoring your bid. If I can help someone out by the use of any of my auction pictures, please feel free to use them. We all work hard at this and if I can save some time and trouble for you, I would be happy to. I realize they are not all the best, but.... you need not ask permission, as it is granted.');
