INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046511541, 1323, 'LOT OF TWO VINTAGE SHAVERS', 9.99, 9.99, 36.85, 0, 'Fall River, MA', 41.684152, -71.17436, 'USA', '2001-12-09 19:56:41', '2001-12-16 19:56:41', 'if (navigator.appName == ''Microsoft Internet Explorer'') { if (navigator.appVersion.substring(0,1) "); } else { document.write(" "); document.write(" "); document.write(" "); document.write(" BODY { background: url(http://www.aqualityfurniture.com/backgr/gold.gif) }"); document.write(" "); document.write(" "); } } else { //Default to Netscape settings. document.write(" "); } Click picture to see actual image size. LOT OF TWO VINTAGE SHAVERS This auction is for two electric shavers. The first one is a Ronson that works and comes in a case. The other one is Sunbeam that also works and comes in a leather pouch. These would be nice to add to your collection. Please see shipping costs/methods and insurance requirements below. For larger items please click here to email us for a quote. All breakables and items valued near and above $50 will have insurance required. If the item is shipped via FedEx this coverage is automatic up to $100 in value, 40_ for each additional $100 coverage. For USPS delivery, $1.25 up to $50, $1.00 each additional $100. All uninsured parcels become the responsiblity of the bidder once said parcel is duly delivered to the appropriate carrier. DELIVERY CAN BE MADE WITHIN A 250 MILE RADIUS OF OUR STORE ON OUR LARGER ITEMS. PLEASE EMAIL FOR A DELIVERY QUOTE The following types of payment are accepted: money orders, personal checks*, and all major credit cards. Payment must be received within 10 business days in order to avoid negative feedback and being reported to eBay as a non-payer. This will also expedite shipping of your item. * All returned checks will be accessed a $25 service fee. Buyer to pay $4.50 for shipping and handling. All international bidders MUST email us for an adjusted S&H quote! . Ma residents pay a 5% sales tax. SHIPPING METHODS: The bidder may at any time request the shipping service of their choice, to which will be added an appropriate handling fee. MEDIA: We have been shipping media items (records, books, etc.) by Media mail, but have experienced slow delivery times, so we are trying to move away from this service. Smaller, light-weight media items over 13 ozs. are still quoted for Media mail and the bidder may request a different delivery service. However, we WILL NOT be held responsible for the long amount of time any Media mail shipment may take. SMALLER ITEMS: Other smaller items up to 13 ozs. are shipped first class. All other items are shipped either Priority mail or FedEx. Usually anything over a few pounds is shipped via FedEx, hence the higher costs. However, their exemplary service is guarenteed, carries automatic insurance up to $100 in value, and is trackable with out additional cost. Any item shipped through the USPS Priority service without requesting additional services such as delivery confirmation can not be tracked, nor will we be held responsibility for its not being delivered (see insurance disclaimer above). LARGER ITEMS: Larger items such as furniture and such are shipped either with BAX Global or a local mover we use who makes east coast runs every two-three weeks. HANDLING FEES: Since our shipping department needs to eat (and we require him to wear shoes, please! ), and shipping materials do cost money (really!) all items have an appropriate handling fee. Basically, the more time and care taken to prepare an item for safe transport, the higher the fee. We do our best to provide both cost effective and careful handling of packaging your item. This fee is not negotiable and is usually reflected in all posted S&H charges, or added to shipping quotes for larger items. Created by eBay Seller''s Assistant Pro');
