INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046523380, 2480, 'DARKNESS # 25 AP MUSEUM EDITION SIGNED w/bns', 157.5, 19.99, null, 7, 'Northridge CA', null, null, 'USA', '2001-12-09 20:09:26', '2001-12-16 20:09:26', 'Item Title DARKNESS # 25 ARTIST PROOF MUSEUM EDITION SIGNED BY MARK SILVESTRI. #''d 10 of AP. As a bonus we will include a free copy of the original Darkness # 25. We accept payment through X.com''s PayPal! We are VERIFIED so Buyer Protection is guaranteed. FREE LIMITED EDITION AUTOGRAPHED WOLVERINE with certificate of authenticity COMIC BOOK (worth $10 or more) WITH "BUY IT NOW!" Click the image to see a larger view Click the image to see a larger view Description: Darkness # 25 Artist Proof Museum Edition Signed by Mark Silvestri. Exteremly limited to only 10 Artist Proof copies world wide. This book even more limited because it is one of a hand full of Museum Editions that were signed for Jay Company by Marc Silvestri himself. Includes Jay Company Certificate of Authenticity. Musuem Editions are starting to become Extremely hot commodity due to there limited quantities of 25 or 50 copies worldwide. The Artist Proofs are even more limited to only a maximum of 10 copies making them even more rare than the regular edition. With such a short supply and such a rise in demand these books are getting harder and harder to find. Our Museum Edition are placed in Hard Plastic Top Loaders to prevent damages to the book during shipping at no extra cost to our customers. Item is still sealed with Jay Company''s seal. Condition: The book is in Near Mint or greater Condition All our books are in Mint or Near Mint+ conditions unless other wise noted in the description. All of our books come bagged with a backboard. We have been collecting for over 12 years, so bid with confidence that the books have been taken care of. Shipping: Buyer agrees to pay $1.99 for United States domestic shipping using United States Postal Service for shipping and handling for this item. International shipping costs are different so if you are outside of the US please email us with your address so shipping can be adjusted. Usually international shipping is $10.39 ($8.39 in Canada) for global priority mail. You may combine multiple winning bids to save on shipping! Shipping for second item is free, third & fourth item is an additional $ 1.25. Five or more items add $ .75 each. All items are shipped priority mail, UPS, or FedEx for safe shipping unless otherwise noted or previously negotiated. We do our best to insure that our items are well packaged. We have received many complements on our shipping. Insurance : Insurance is optional, but recommended. If you do not insure your item, then we are not responsible for lost, stolen, and/or damaged goods. Insurance is $1.21 for each $50 within United States. We can not offer insurance on global shipping unless it is shipping Express mail or Air Parcel post. To insure that our customers feel that they are getting the best protection_ possible we have been certified by Paypal & Squaretrade._ All purchases are insured by Squaretrade (up to $250.00), Ebay (up to $200), and Paypal (if used for payment (additional $200 for ebay)._ We also offer shipping insurance through the shipping carrier used. Payment : All payments must be received within 14 days of auction close. An automated invoice will be sent to you with 48 hours of auction close. You will also be notified of payment receipt and when the item ships. Payment Options : Visa/MasterCard via Paypal . Visa, MasterCard, & American Express. via fax or email. A copy of the Credit Card and photo ID is required. We also accept many other online payment methods. Please email us if you prefer other methods. Money Orders/Cashiers Check/Cash (cash is not recommended but accepted.) Personal Checks (Items will be held until check clears.) (Items might ship sooner if there are positive unique feedbacks of higher than 50 and no negative feedback). Sales Tax: California residents Must add 8% sales tax. Please be aware that starting January 1, 2002 the sales tax will increase to 8.25%. If your payment is received after December 31, 2001 you will be required to pay 8.25% sales tax. Other Info : CLICK HERE TO VIEW OUR OTHER AUCTIONS If you have any questions please email us at service@massquecollectibles.com . By bidding on this item you, the bidder, agree to the following terms & conditions: Winning bidder (s) agree to pay the final bid price and the shipping costs listed in the auction description. If you bid on our items, you are expected to submit payment promptly. Because of the increasing number of non paying bidders we will enforce the following policy: Payment not received within fourteen (14) days - Non-Paying Bidder Alert.* No payment within thirty (30) days - The auction will be considered null and void. The item will be re-listed and ebay will be informed of "dead-beat" bidder. The bidder will be placed on our blocked list and negative feedback maybe left. * A Non-Paying Bidder Alert does not affect your account in any manner. At this point ebay will send you a reminder for payment. It is the required first step for an ebay seller to begin the process for a refund. If payment is made via personal check, the bidder understands that the items will not ship until the check clear - minimum of five (5) business days. There will be a $25 fee for all returned checks! ALL FUNDS MUST BE DRAWN IN US DOLLARS. NO EXCEPTIONS! ITEMS TYPICALLY SHIPPED THE WEEK WE RECEIVE PAYMENT, if not sooner. Payments with credit cards, money orders, and Paypal are given top priority, but due to the number of auctions we can not guarantee that it will be shipped in less than a week. If you wish to have the items delivered by a specific date, please email us in advance and we will do our best to accommodate your request. ****International Bidders (outside of USA): It is our policy on items being shipped overseas *not* to mark them off as "gifts", nor is it our policy to undervalue the item so bidders can avoid import duties. If this is a problem then do not bid on our item. Please email if there are any questions or problems with the auction (s)!');
