INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046525565, 2494, 'RARE "SAVAGE SAM" WALT DISNEY MOVIE PICTURE''S', 9.99, 9.99, null, 0, 'ALONG THE ST. CROIX', null, null, 'USA', '2001-12-09 20:12:12', '2001-12-16 20:12:12', '.titledata { font-family: verdana, sans-serif; font-size:17px; color:#ffffff; } .description { font-family: verdana, sans-serif; color:#FFFFFF; background-color : #006699; } a.textLink { color:#fcfcfc;} HR { color: #ffffff; } RARE "SAVAGE SAM" WALT DISNEY MOVIE PICTURE''S THIS 1963 8 1/2"T X 11"L "PICTORIAL HIGHLIGHTS" OF WALT DISNEY''S SAVAGE SAM... THE AMALGAMATED TEXAS POTHOUND. A TECHNICOLOR MOVIE. STARRING "BRIAN KEITH - TOMMY KIRK - KEVIN CORCORAN -MARTA KRISTEN - SLIM PICKENS AND MORE. "RELEASED BY BUENA VISTA DISTRIBUTION CO., INC. 1963 WALT DISNEY PRODUCTIONS". IN UPPER LEFT CORNER OF COVER IT SAYS "FROM CHARLES LEVY - DIRECTOR OF ADVERTISING & PUBLICITY - BUENA VISTA DISTRIBUTION CO., INC. - 477 MADISON AVE. - NEW YORK 22, N.Y.". THERE ARE 24 REAL PHOTOS, 12 ARE 6 1/2"T X 9 1/4"L AND 12 ARE 8"T X 7 1/8"W IN THIS PICTORIAL HIGHTLIGHT BOOKLET. ON THE BACK OF EACH PHOTO WHICH IS LIGHTLY GLUED INTO PAGE AT TOP, IT IS STAMPED "MCMLXII OR MCMLXIII WALT DISNEY PRODUCTIONS - WORLD RIGHTS RESERVED". THE FIRST PHOTO OF BRIAN KEITH HAS TWO CREASES AND ONE OTHER PHOTO HAS A SMALL BEND IN CORNER(NOT SHOWN). THERE IS ONE PHOTO OF SAVAGE SAM(SON OF OLD YELLER) THAT I DID NOT SHOW. THERE IS SOME LIGHT AGE CRACKS ON SOME PHOTOS. FRONT AND BACK COVERS HAVE SOME SOILING AS YOU CAN SEE IN PICTURES. SOME PAGE CORNERS ARE BENT. ALL TYPING IS GOOD, SCANNER MADE IT LOOK BAD IN SOME PICTURES. CLICK ON PICTURES TO ENLARGE FOR CLOSE-UP OF CONDITION. ANY QUESTIONS OR MORE PICTURES PLEASE PLEASE EMAIL BEFORE BIDDING. S/H WILL BE $5.50 TO U.S.(L.48). THANK YOU FOR LOOKING!!!!!!!!! ~ PLEASE READ BELOW~ PLEASE READ THIS BEFORE BIDDING!!! IF YOU WANT INSURANCE ON A ITEM IT IS YOUR RESPONSIBILITY TO LET ME KNOW AND I WILL GET A PRICE FOR YOU! NOT RESPONSIBLE FOR UNINSURED ITEMS. I DO NOT USE THE "CHECKOUT". SORRY I DO NOT TAKE BILLPOINT OR PAYPAL! I DO TAKE c2it or BIDPAY! ALL INTERNATIONAL HIGH BIDDERS MUST PAY WITH BIDPAY.COM OR c2it. IF YOU HAVE BAD FEEDBACK ABOUT PAYING DO NOT BID! IF YOU CHANGE YOUR MIND AFTER BEING HIGH BIDDER, YOU ARE STILL IN A CONTRACT TO PAY!!! PAYMENT MUST BE MADE WITHIN 10 DAYS OF END OF AUCTION OR NEGATIVE FEEDBACK WILL BE GIVEN!! BECAUSE I HAVE WAY TOO MANY SLOW PAYERS AND NO PAYERS!!! TO THE GOOD CUSTOMERS SORRY YOU HAVE TO READ THIS. THANK YOU!! Payment I accept the following forms of payment: c2it(sm) by Citibank, Money Order, Personal Check, VISA-MASTERCARD W/BIDPAY OR c2it : U.S.CHECKS W/10 DAY HOLD. Additional Information Click image to view larger version Click image to view larger version Click image to view larger version Click image to view larger version Click image to view larger version Click image to view larger version Full service auction management with free online payment service: AuctionWatch');
