INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046530572, 1976, 'Vintage Community Silver Baby Child Cup', 3, 3, null, 1, 'Pacific Northwest', null, null, 'USA', '2001-12-09 20:17:56', '2001-12-16 20:17:56', 'Vintage Silver Cup (Please Be Patient! There Are 3 Pictures Below!) This cup is stamped "Coronation Community" on the bottom. It measure 2 1/2 inches tall and 2 1/2 inches in diameter. It has attractive detail on the handle. The cup is in good condition, but it is in need of cleaning, and it has a small dent on one side. It is used, but has character! PLEASE READ THIS SHIPPING AND PAYMENT INFORMATION! Buyer to pay actual shipping costs. We accept Money Orders and Cashier''s Checks. We accept PayPal ONLY for sales over $8.00 total, ONLY if you pay for a USPS Confirmation Number (50_), ONLY if you provide a Confirmed Address with PayPal, AND ONLY if you receive shipment at your Confirmed Address!! We accept personal checks, but there will be a 7 to 10 day wait for the check to clear. We recommend that you insure your shipment. We package all items very securely, but we cannot be responsible for shipping damage. Free Honesty Counters powered by Andale! Payment Details See item description and Payment Instructions, or contact seller for more information. Payment Instructions See item description or contact seller for more information.');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046530672, 2453, 'FONTANINI PORCELAIN HINGED BOX HOLY FAMILY', 9.99, 9.99, null, 1, 'Arkansas', 33.580919, -92.26477, 'USA', '2001-12-09 20:17:34', '2001-12-16 20:17:34', 'FONTANINI PORCELAIN HINGED BOX HOLY FAMILY This is an exquisite Fontanini porcelain hinged box, by Roman, with the most precious treasure inside. It has incredible detail on the outside and inside. The figures are crafted in the USA. The box is shaped like a crown, and is 3 inches tall 1.75 inches wide. This retired item is new in original box. Never Used or displayed. This is sure to become a family heirloom! Stock is very limited. I have 2 other styles while they last! Shipping, Handling & Insurance $4.85. ZE7PHB I COMBINE PURCHASES TO SAVE YOU SHIPPING! CHRISTMAS SHIPPING NOTICE! LAST SHIPMENT WILL BE 12/19/01. I WILL NEED YOUR PAYMENT BY 12/18/01 TO SHIP ON THE 19TH. THE CHANCES OF IT MAKING IT THERE IF FOR CHRISTMAS AFTER THAT DATE ARE SMALL. WE ARE TAKING A FEW DAYS TO SPEND WITH OUR FAMILY FOR THE HOLIDAYS. WE HOPE YOU ARE ABLE TO DO THE SAME! THE NEXT SHIPPING DAY WILL BE THE 12/28. I WILL BE CHECKING ONLINE FOR QUESTIONS. I THANK YOU FOR YOUR BUSINESS! MAY ALL THE BLESSINGS OF THE SEASON BE YOURS! Thank you for your interest! If you have questions, please email me at icjobee@aol.com PLEASE READ TERMS I regret the need for this list, but after 3 years of selling, I have found it imperative, and tried to make it as concise as possible, and make sure you are informed. Winner pays shipping. Most items have fixed shipping in the listing ad. I ship Priority Mail unless otherwise stated. Envelope items with 1st class shipping do not include insurance and by accepting this method of shipping you are taking the risk of it being lost in the mail. Rare, but it can & has happened. Money order or Visa & MasterCard through PayPal Or PayDirect. Checks accepted for amounts under 30.00 with the right to wait 14 business days after the check arrives for checks to clear. Shipping days are Tuesday and Friday. If there are special circumstances, & you need your package shipped on a different day, I will make every effort to comply. During the holiday season, I ship every weekday as sales warrant. Arkansas Sales will need to add 6.125% to the item price. Once I have your address I can calculate it for you. Please read the description. I make every effort to fully disclose all flaws in a short description. Vintage items are sold in the same condition I buy them. Due to nerve damage in my right hand & arm, I cannot wash every item because I loose control. We pack every item VERY carefully, but occasionally breakage happens anyway, and the buyer is responsible for filing and collecting the insurance claim per the rules of the Postal Service. Sellers put a lot of time and money into having these auctions available for your consideration. Please be kind, only bid if you intend to follow through. As with many sellers, this is my only source of income and I depend on you honoring your bid. If I can help someone out by the use of any of my auction pictures, please feel free to use them. We all work hard at this and if I can save some time and trouble for you, I would be happy to. I realize they are not all the best, but.... you need not ask permission, as it is granted.');
