INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046560827, 2560, 'Vintage tablecloth-pink roses, yellow stripes', 8, 8, null, 1, 'SW Illinois', null, null, 'USA', '2001-12-09 21:00:07', '2001-12-16 21:00:07', '.titledata { font-family: verdana, sans-serif; font-size:17px; color:#ffffff; font-weight : bold; } .description { font-family: verdana, sans-serif; color:#000000; } .link { font-family: verdana, sans-serif; font-size:12px; underline; } HR { color: #000000; } Vintage tablecloth-pink roses, yellow stripes This white cotton tablecloth is approx. 44" x 52. Two sides are machine hemmed and two are a selvage edge. There''s a 6 wide pink rose design around the outside edge and the center. There is a faint yellow and white checked pattern underneath the flowers. There are 10-12 BB size or smaller worn spots, some all the way through and some just beginning. They''re mostly around the edges. There are 8-10 very small faint spots that may soak out. About _'' if the hem has come undone in two corners. The colors are gently faded from use. Buyer pays $3.00 s/h. International rates vary. We are happy to combine shipments. Just send us an email if you are a multiple winner. Payment I accept the following forms of payment: PayPal, Money Order, Personal Check, (CHECKS on U.S. Accounts ONLY). Additional Information Click image to view larger version Click image to view larger version Low cost image hosting and full service auction management solutions: AuctionWatch');
INSERT INTO just_bid_it.item (id, seller_id, name, current_bid, first_bid, buy_price, number_of_bids, location, latitude, longitude, country, start, end, description) VALUES (1046560946, 2562, 'Tupperware NEW Green Rare Thatsa Bowl 32 cups', 5.5, 1, null, 6, 'Vermont', 43.410672, -72.429777, 'USA', '2001-12-09 21:00:17', '2001-12-16 21:00:17', 'Tupperware Thatsa Bowl Item Description: This is a great bowl, with an enormous 32-cup capacity. It''s 6 1/8"H x 14 1/2"W and has a one-of-a-kind thumb loop for a secure grip and a virtually liquid-tight seal for storage. Seal is *exclusive hunter green* with a large tab for easy removal. Bowl is white and useful for everything from mixing, to salads, to popcorn, as a fruit bowl, or for any number of craft projects. I''ve used ours for soaking my feet too - it''s great! Brand new. Retail value is $16.50. Use it alone or couple it with measuring spoons, cups, kitchen towel and a rolling pin, pastry sheet, cookie mix, spaghetti, or similar items, and you''ve got a super, high-quality housewarming, Christmas, or wedding gift that will give years of everyday use and enjoyment! Notes: Brand new - never used. One of our family''s favorites! Great for the holidays - either for personal use or as a gift! Ours is a pet-free, non-smoking home. AS ALWAYS, NO RESERVE Email us if you have any questions! See our ABOUT ME page to learn about our auction policies and practices including details on shipping and handling and payment options. CLICK HERE FOR THE "OFFICIAL" TUPPERWARE PHOTO Note it''s the larger of the two bowls. Shipping/Handling: $6.00 s/h anywhere in the US $8.00 s/h to Canada Payment Options: We ship to locations in the US or CANADA ONLY. If you are the winning bidder of multiple auctions, we gladly combine items to help keep shipping costs down and save you money on shipping/handling where possible. In all our auctions, we list a fixed shipping/handling rate. This is to allow you to know exactly what you would pay for an item if you win it . Please bid accordingly. Our fixed rate allows you to bid with confidence the most you would be willing to spend on an item, knowing all your charges ahead of time. It removes the guesswork as to what "actual shipping" might mean, as well as the possibility of any hidden charges at the end of an auction. A fixed rate also helps us cover costs we incur in the course of completing the sale, including but not limited to actual shipping costs, mileage to the post office (we live in a rural area), and packaging materials. Insurance is optional and not included unless otherwise stated. If you would like insurance, please let us know and include an additional $1.10 along with your payment (up to $50 coverage). Please note that we are not responsible for uninsured items which are lost or damaged during shipping. Billpoint - E-checks and credit and debit card payments welcome via Billpoint. Paypal - Our preferred method of payment is Paypal ( Account name: TupajTutor@aol.com ). Please note that we cannot take credit or debit card payments via Paypal. Payments are accepted from non-credit card transactions, including payment from your paypal balance, e-check, or instant transfer. Money Orders Personal Checks - Checks will be held for 7-10 days prior to shipping. Credit Cards - We glady accept payments from credit and debit cards via Billpoint , including VISA/MasterCard and Discover. Pre-paid postage, meter strips, or SASEs are NOT considered valid forms of payment. Shipment of your auction item(s)will be significantly delayed by the process of having to request the correct payment from you, and we reserve the right to add a surcharge of $1 to the auction total for the inconvenience. Please do not send cash as it can easily be stolen. Payments for international transactions , where applicable, are accepted through Billpoint and Paypal ONLY unless prior arrangements are made. Ruby Lane Antiques & Collectibles Please look at my other items for sale! We have Tupperware, items for kids, custom fridge magnets, nature photography, clothes and many other items listed each week. View and search all the items in my picture gallery This listing generated by Auctiva Poster Download it for free!');
